INSERT INTO `pages_fields` (`id_pages`, `id_fields`, `default_value`, `help`) VALUES
(0000000002, 0000000106, NULL, 'A short description of the research project. This field will be used as `meta:description` in the HTML header. Some services use this tag to provide the user with information on the webpage (e.g. automatic link-replacement in messaging tools on smartphones use this description.)'),
(0000000002, 0000000115, NULL, 'This field defines the content of the alert message that is shown when a date is set in the field `maintainence_date`. Use markdown with the special keyword `@date` which will be replaced by a human-readable form of the field `maintainence_date`.'),
(0000000002, 0000000117, NULL, 'If set (together with the field `maintenance_time`), an alert message is shown at the top of the page displaying to content as defined in the field `maintenance` (where the key `@data` is replaced by this field).'),
(0000000002, 0000000118, NULL, 'If set (together with the field `maintenance_date`), an alert message is shown at the top of the page displaying to content as defined in the field `maintenance` (where the key `@time` is replaced by this field).');
