(0000000246, 0000000025, 0000000003, 0000000001, 'A quiz can be used to ask a question with the field `caption`. A quiz has two tabs **Right** and **Wrong** where the content is defined by field `right_content` and `wrong_content`, respectively and the label of the tab is defined by the fields `label_right` and `label_wrong`, respectively.\r\nThe field `type` specifies the color of all tabs.'),
