(0000000250, 0000000025, 0000000002, 0000000002, ''),
(0000000250, 0000000025, 0000000003, 0000000001, 'The SelfHelp app provides two styles to create markdown content:\r\n- `markdown` renders a complete markdown block, including headings, paragraphs, images, lists, tables, etc.\r\n- `markdownInline` renders one line of markdown text and can be used to put emphasis to text elements or add inline links.\r\n\r\nBoth styles use the markdown parser [Parsedown](http://parsedown.org/).\r\n\r\nThis [Markdown Guide](https://www.markdownguide.org/basic-syntax) provides an overview of the commonly available markdown syntax.\r\nThe specifix syntax that is supported by the SelfHelp app can be found on the [Parsedown](http://parsedown.org/) Webpage.\r\n\r\nThe style field `data_config` expects a JSON list. In the JSON, we can define how we would like to extract some data from DB and load into the traces. JSON Structure:\r\n ```\r\n [\r\n	{\r\n		\"type\": \"static|dynamic\",\r\n		\"table\": \"table_name | #url_param1\",\r\n        \"retrieve\": \"first | last | all\",\r\n		\"fields\": [\r\n			{\r\n				\"field_name\": \"name | #url_param2\",\r\n				\"field_holder\": \"@field_1\",\r\n				\"not_found_text\": \"my field was not found\"				\r\n			}\r\n		]\r\n	}\r\n]\r\n```\r\n\r\nExample: \r\n ```\r\n [\r\n	{\r\n		\"type\": \"static\",\r\n		\"table\": \"my_table\",\r\n        \"retrieve\": \"first\",\r\n		\"fields\": [\r\n			{\r\n				\"field_name\": \"my_field\",\r\n				\"field_holder\": \"@field_holder\",\r\n				\"not_found_text\": \"my field was not found\"				\r\n			}\r\n		]\r\n	}\r\n]\r\n```\r\n\r\nIt means that the code will search the first row in table `my_table` and it will get the value of field `my_field`. Then the value will be assigned and if keyword `@field_holder` is used in `text_md`, it will be replaced with the found value. If no value was found it will return the predefined string `not_found_text`.\r\n\r\n#### Images\r\n\r\nA custom extension of the functionality of [Parsedown](http://parsedown.org/) allows to specify the size and style of images with a custom syntax:\r\n\r\n```\r\n![__alt__](__path__|__width__x__height__|__css__ \"__title__\")\r\n```\r\nwhere\r\n- `__alt__` is the text that is displayed if the image cannot be loaded.\r\n- `__path__` is the url of the image (when using an asset simply prepend the name of the asset with `%`).\r\n- `__width__` is the with of the image.\r\n- `__height__` is the height of the image.\r\n- `__css__` is a comma-seperated list of css classes (no spaces).\r\n- `__title__` is the text that is displayed when hovering over the image.\r\n\r\nNote that images need to be loaded from the asset folder on the server and can, in general, not be linked by a url. This is blocked due to security reasons (an exception is the url https://via.placeholder.com which is very handy to quickly use placeholder images). \r\n\r\n#### Links\r\n\r\nLinks are written in the form `[Label](link)`.\r\nA `link` can either be internal or external. An external `link` can point to any url and must start with a protocol (i.e. `http://` or `https://`). An internal `link` can point to any page, navigation section, wrapper section, or asset within the SelfHelp domain. Use the same syntax as with the linking styles (refer to [the link style documentation](#style/link-navigationContainer)).\r\n\r\nIn addition to this, a `link` can be prepended with `!` which will cause the link to be opened in a new browser tab.'),
