(0000000276, 0000000025, 0000000003, 0000000001, 'The style `figure` allows to render either an image or a video with a caption. The caption is defined by the field `caption`. If this field is left empty no caption is rendered. A caption is prepended by the text defined in the field `caption_title`. If this is left empty, the text **Figure** is used by default.'),
