(0000000278, 0000000025, 0000000002, 0000000002, ''),
(0000000278, 0000000025, 0000000003, 0000000001, 'The style `video` allows to render a video. The field `sources` defines the different video sources. Multiple sources can be provided to cope with browser incompatibilities.\r\n\r\nNote that the field `sources` is of type `json` and requires\r\n1. valid json syntax (see https://www.json.org/)\r\n2. a json field `source` and `type` for each video source\r\n\r\nIt is best to copy the example below and adapt the video names and types according to your requirements.\r\n\r\n```\r\n[{\r\n  \"source\": \"video_name.mp4\",\r\n  \"type\": \"video/mp4\"\r\n},\r\n{\r\n  \"source\":\"video_name.ogg\",\r\n  \"type\": \"video/ogg\"\r\n},\r\n{\r\n  \"source\":\"video_name.webm\",\r\n  \"type\": \"video/webm\"\r\n}]\r\n```\r\n\r\nThe field `alt` allows to define the text that will be displayed if no video file can be loaded.'),
(0000000278, 0000000025, 0000000003, 0000000002, ''),
(0000000279, 0000000023, 0000000001, 0000000001, ''),
(0000000279, 0000000025, 0000000002, 0000000001, ''),
(0000000279, 0000000025, 0000000002, 0000000002, ''),
(0000000279, 0000000025, 0000000003, 0000000001, 'The media styles allow to display different media on a webpage. The following styles are available:\r\n\r\n- `audio` allows to load and replay an audio source on a page.\r\n- `figure` allows to attach a caption to media elements. A figure expects a media style as its immediate child.\r\n- `image` allows to render an image on a page.\r\n- `progressBar` allows to render a static progress bar.\r\n- `video` allows to load and display a video on a page.\r\n\r\nThe styles `image` and `video` can be made responsive by enabling the field `is_fluid`. Also, they both can be wrapped by the style `figure` which allows to add a caption to the medium.'),
(0000000279, 0000000025, 0000000003, 0000000002, ''),
(0000000281, 0000000023, 0000000001, 0000000001, ''),
(0000000281, 0000000025, 0000000002, 0000000001, ''),
(0000000281, 0000000025, 0000000002, 0000000002, ''),
(0000000281, 0000000025, 0000000003, 0000000001, 'The style `image` allows to render an image on the page. The field `source` defines the location of the image to be displayed and the field `alt` defines the text that will be displayed if the image cannot be found. The figure will not be rendered if the field `source` is left empty. Either a valid URL of the image or the name of the image as it is stored in the asset path on the server is accepted.\r\n\r\nThe field `title` defines the text that will be displayed when hovering with the mouse over the image.'),
