(0000000324, 0000000025, 0000000003, 0000000001, 'The style `form` supports some Bootstrap color schemes for the submit button. This is specified with the field `type`. The field `url` specifies the submit location. If left empty, the form is not rendered. The field `label` defines the text that appears on the submit button.'),
(0000000324, 0000000025, 0000000003, 0000000002, ''),
(0000000326, 0000000023, 0000000001, 0000000001, ''),
(0000000326, 0000000025, 0000000002, 0000000001, ''),
(0000000326, 0000000025, 0000000002, 0000000002, ''),
(0000000326, 0000000025, 0000000003, 0000000001, 'The style `input` support several different types. In addition to the standard fields any form-field has (`value`, `label`, `name`), the style `input` supports the field `placeholder`. It defines the greyed-out text that appears inside a form-field as long as no value is entered. Some input types do not use this field.\r\n\r\nField `format` can be used for data formatting. Examples:\r\n - `H:i`- can be used for time - 22:10\r\n - `Y-m-d H:i` - can be used for date plus time - 2020-12-07 22:10\r\n - `d-m-y` - can be used for date - 27-12-2020'),
(0000000326, 0000000025, 0000000003, 0000000002, ''),
(0000000329, 0000000023, 0000000001, 0000000001, ''),
(0000000329, 0000000025, 0000000002, 0000000001, ''),
(0000000329, 0000000025, 0000000002, 0000000002, ''),
(0000000329, 0000000025, 0000000003, 0000000001, 'The style `select` is rendered as a selection list or a dropdown where one or more options can be selected. The field `items` allows to specify the options in the selection list. Note that the field `items` is of type `json` and requires\r\n1. valid json syntax (see https://www.json.org/)\r\n2. a json field `value` and `text` for each select option\r\n\r\nIt is best to copy the example below and adapt the option names and values according to your requirements.\r\n\r\n```\r\n[{\r\n  \"value\":\"1\",\r\n  \"text\": \"Item1\"\r\n},\r\n{\r\n  \"value\":\"2\",\r\n  \"text\":\"Item2\"\r\n},\r\n{\r\n  \"value\":\"3\",\r\n  \"text\": \"Item3\"\r\n}]\r\n```\r\n\r\nThe field `alt` specifies the text that is displayed on the disabled option when no default value is defined.\r\n\r\nThe field `live_search` enables a search textbox where the items can be filtered.'),
(0000000329, 0000000025, 0000000003, 0000000002, ''),
