(0000000347, 0000000025, 0000000002, 0000000002, ''),
(0000000347, 0000000025, 0000000003, 0000000001, 'Lists are styles that allow to define more sophisticated lists than the markdown syntax allows. They come with attached javascript functionality. The following lists are available:\r\n\r\n- `accordionList` is a hierarchical list where the root level is rendered as an accordion with only one root item expanded at a time.\r\n- `nestedList`is a hierarchical list where each root item item can be collapsed and expanded by clicking on a chevron.\r\n- `sortableList` is not hierarchical but can be sorted, new items can be added as well as items can be deleted. Note that only the visual aspects of these functions are rendered. The implementation of the functions need to be defined separately with javascript (See <a href=\"https://github.com/RubaXa/Sortable\" target=\"_blank\">Sortable</a> for more details).\r\n\r\nAll list styles have the field `id_prefix` which is required to prevent interference if multiple lists of the same type are used on the same page. Further, each list style has the field `items` which allows to specify the items to be rendered in the list. Note that the field `items` is of type `json` and requires\r\n1. valid json syntax (see https://www.json.org/)\r\n2. a json field `id` and `title` for each item where\r\n  - `id` is a unique number identifying the item\r\n  - `title` is the name of the item to be rendered\r\n\r\nOptionally, all lists support the field `url` in each item which allows to specify the target link of an item.\r\n\r\nThe style `accordionList` and `nestedList` are nested lists. Hence, each item can have the field `children` which can hold multiple items. Further, both these lists support the field `id_active` which allows to specify which item is set as active.\r\n\r\nAn example of a nested json object is given in the following. Use this example and modify it according to your needs:\r\n\r\n```\r\n[{\r\n  \"id\": 1,\r\n  \"title\": \"Item1\",\r\n  \"children\": [\r\n     {\r\n       \"id\": 2,\r\n       \"title\": \"Item1.1\"\r\n     },\r\n     {\r\n       \"id\": 3,\r\n       \"title\": \"Item1.2\"\r\n     },\r\n  ]\r\n},\r\n{\r\n  \"id\": 4,\r\n  \"title\": \"Item2\"\r\n},\r\n{\r\n  \"id\": 5,\r\n  \"title\": \"Item3\"\r\n}]\r\n```'),
(0000000347, 0000000025, 0000000003, 0000000002, ''),
(0000000348, 0000000023, 0000000001, 0000000001, ''),
