(0000000364, 0000000025, 0000000003, 0000000001, 'A nested list is a hierarchical list where each root item item can be collapsed and expanded by clicking on a chevron. The following examples all use the same json configuration (field `items`):\r\n\r\n```\r\n[{\r\n  \"id\": 1,\r\n  \"title\": \"Item1\",\r\n  \"url\": \"#\",\r\n  \"children\": [{\r\n      \"id\": 2,\r\n      \"title\": \"Item1.1\"\r\n    },\r\n    {\r\n      \"id\": 3,\r\n      \"title\": \"Item1.2\",\r\n      \"children\": [{\r\n          \"id\": 4,\r\n          \"title\": \"Item1.2.1\",\r\n          \"url\": \"#\"\r\n        }]\r\n    }]\r\n},\r\n{\r\n  \"id\": 5,\r\n  \"title\": \"Item2\",\r\n  \"url\": \"#\",\r\n  \"children\": [{\r\n       \"id\": 5,\r\n       \"title\": \"Item2.1\"\r\n    }]\r\n},\r\n{\r\n  \"id\": 6,\r\n  \"title\": \"Item3\",\r\n  \"children\": [{\r\n       \"id\": 7,\r\n       \"title\": \"Item3.1\",\r\n       \"url\": \"#\"\r\n    }]\r\n}]\r\n```\r\n\r\nTo make this style responsive the field `title_prefix` can be used.\r\nIf this is set to something else than the empty string the list will be collapsed on smaller screens and this string will be prefixed to the selected item.'),
(0000000364, 0000000025, 0000000003, 0000000002, ''),
