(0000000374, 0000000025, 0000000003, 0000000001, 'A sortable list is not hierarchical but can be sorted, new items can be added as well as items can be deleted. Note that only the visual aspects of these functions are rendered. The implementation of the functions need to be defined seperately (see [Sortable](https://github.com/RubaXa/Sortable) for more details).\r\n\r\nThe style field `is_editable` allows to enable or disable all modifications on the list. This means that the configuration for sorting, adding and deleting items only has an effect if `is_editable` is enabled.\r\n\r\nNote that the json field `children` is not supported for sortable list items. Also note that an individual css class can be attached to each item with the json field `css`. This is useful for ignoring or blocking items when dragging (see [Sortable](https://github.com/RubaXa/Sortable) for more details).\r\n\r\nFor the all examples the following json configuration is used:\r\n\r\n\r\n```\r\n[{\r\n  \"id\": 1,\r\n  \"title\": \"Item 1\"\r\n},{\r\n  \"id\": 2,\r\n  \"title\": \"Item 2\",\r\n  \"url\": \"#\",\r\n  \"css\": \"custom\"\r\n},{\r\n  \"id\": 3,\r\n  \"title\": \"Item 3\"\r\n}]\r\n```'),
