(0000000394, 0000000025, 0000000003, 0000000001, '# Extending the Code\r\n\r\nThe app is designed in such a way that it can be extended with new styles or custom components without having to modify existing code. '),
(0000000394, 0000000025, 0000000003, 0000000002, ''),
