(0000000398, 0000000025, 0000000002, 0000000002, ''),
(0000000398, 0000000025, 0000000003, 0000000001, 'Conceptually, the app consists of the following elements:\r\n\r\n- `section`: A section is a piece of content that will be rendered to a page. A page can consist of a single section or can be composed of multiple sections. A section is always associated with a `style`.\r\n- `style`: A style defines the apperance of a section and specifies the type of content that can be assigned to a section. The content is specified through `fields`.\r\n- `field`: A field defines a specific bit of content that will be rendered within a section. Each style has a set of fields and the style template defines where these fields will be rendered. However, given that multiple sections can have the same styles, while the type of a field remains always the same, the content is specific for each section.\r\n- `component`: To seperate concerns the [Model-View-Controller (MVC)](https://en.wikipedia.org/wiki/Model%E2%80%93view%E2%80%93controller) pattern is used. In order to simplify the handling of this pattern components are introduced: A component combines a model, a view, and a controller into one class which allows to encapsulate the MVC pattern without losing the aspect of seperation. Every style is a component but a component must not necessarily be a style.\r\n- `page`: A page is the root element that is requested by the browser when connecting to a specific url. This means that a page is always associated to a unique `url` and has a unique name (called `keyword`).\r\nSeveral types of pages exist:\r\n  - **Section Page**: A section page is the most common type page. It is a collection of sections that are rendered one below the other.\r\nThe content of section pages can be modified in the CMS.\r\n  - **Navigation Page**: A navigation page is a special type of section page where only one section is rendered at a time.\r\nA set of root sections, or navigation sections, is assigned to a navigation page.\r\nAn id that is postfixed to the url indicates which section is rendered.\r\n  - **Component Page**: A component page renders one single custom component.\r\nThe name of the component to render is matched by the keyword of the page.\r\n  - **Custom Page**: A custom page renders whatever is defined by a function with the name `create_\'page_keyword\'_page()` where `\'page_keyword\'` is the keyword of the page.\r\nThis function must be defined in `index.php`.\r\n- `service`: A service is a collection of functionality that allows to manipulate certain aspects of the application. This includes a handler for database access, user permissions, link generation, user input, content parsing, etc.'),
(0000000398, 0000000025, 0000000003, 0000000002, ''),
(0000000400, 0000000023, 0000000001, 0000000001, ''),
(0000000400, 0000000025, 0000000002, 0000000001, ''),
(0000000400, 0000000025, 0000000002, 0000000002, ''),
(0000000400, 0000000025, 0000000003, 0000000001, 'There are several approaches to customizing the visual aspects of the WebApp.\r\n\r\n### Custom CSS and JS Files\r\nAll `*.css` and `*.js` files that are stored in the folders `css` and `js` of the root project directory are loaded automatically.\r\nConsequently, it is possible to add new stylesheets and javascript functionality without modifying existing code.\r\nNote that the files are loaded alphabetically but only **after** the main stylesheets of the application. This means that existing classes can be extended and overwritten.\r\n\r\nThe WebApp is based on the standard [Bootstrap](https://getbootstrap.com/docs/4.2/getting-started/introduction/) classes.\r\nThese classes can either be extended or overridden in custom css files because custom files are loaded only after the bootstrap stylesheet is loaded.\r\nIf, for eaxmple, the navigation bar should be bright red simply add\r\n```\r\n.navbar.bg-dark {\r\n    background-color: red !important;\r\n}\r\n\r\n```\r\nto a custom stylesheet and place the file in the `css` folder at the project root.\r\n\r\n### Customize Styles\r\nEach style has a field `CSS`.\r\nThe text that is defined in this field will be attached to the `class` attribute of the root html tag of the style.\r\nEither existing bootstrap classes can be used here or custom classes can be used which can further be specified in `css/main.css`.\r\nThis custom class in combination with [CSS selectors and combinators](https://developer.mozilla.org/en-US/docs/Learn/CSS/Introduction_to_CSS/Combinators_and_multiple_selectors) allows to keep a tight control over the style of a specific instance of a style.'),
(0000000400, 0000000025, 0000000003, 0000000002, ''),
(0000000402, 0000000023, 0000000001, 0000000001, ''),
(0000000402, 0000000025, 0000000002, 0000000001, ''),
(0000000402, 0000000025, 0000000002, 0000000002, ''),
(0000000402, 0000000025, 0000000003, 0000000001, 'Working only with styles can be rather limiting, depending on what you want to achieve.\r\nThe problem with styles is that they have a rigid interaction with fields.\r\nThis can be somewhat circumvented by using a field of type `json` which allows to specify complex data structures.\r\nDoing this, however, increases the complexity for the person filling in the content.\r\n\r\nIf database interaction must be implemented that exeeds the capability of fields there is the possibility to create a component which is not a style.\r\nWith such a component the interaction with the database can be fully customised and is not limited by style fields.\r\nHowever, there is a drawback:\r\nThe content of such components cannot be managed by the CMS.\r\n\r\nTo create a custom component the following steps must be followed. Lets assume that the new component is called `myComponent`.\r\n\r\n##### 1. Create the Component Folder\r\nMake sure to create the new folder in the path `server/component/` and also make sure to give the new folder the name of the component:\r\n\r\n```\r\nmkdir sever/component/myComponent\r\n```\r\n\r\n##### 2. Create the Component Classes\r\nThe only class that is required is the component class.\r\nHowever it is recommended to stick to the MCV pattern for reasons of separation of concerns and reusage of code.\r\n\r\nThe component class must be defined in a seperate file which must be placed in the component folder. Make sure that the class file uses the name of the component (with a capital first letter), postfixed with `Component.php`:\r\n\r\n```\r\ntouch server/component/myComponent/MyComponentComponent.php\r\n```\r\n\r\n##### 3. Create a Component Page\r\nFinally a page needs to be created which will render `myComponent`.\r\nIn the CMS create a new page of type **Component** and name it `myComponent`.\r\nFor being able to select the page type **Component** the checkbox **Advanced** must be enabled.'),
(0000000402, 0000000025, 0000000003, 0000000002, ''),
(0000000404, 0000000023, 0000000001, 0000000001, ''),
