(0000000411, 0000000025, 0000000003, 0000000001, 'A page with support for user input stores all data that was submitted by a user via html forms in the database if the style `formUserInput` was used. This data can be downloaded from the database via the export page in the admin menu.\r\n\r\nThe WebApp provides only a very simple predefined style `showUserInput` to display this data. No other component or style to display or evaluate the data is provided because this heavly depends on the experiment. It is, however not very difficult to build a style or component which handles the evaluation of user input data.\r\n\r\nTo access the data stored in the database the `UserInput` service is provided. This service provides a small set of functions that allow to access and filter the user input data. Please refer to the documentation of the source code of the class [`UserInput`](https://selfhelp.psy.unibe.ch/demo/doc/doxygen/html/classUserInput.html) for more details.\r\n\r\nA good starting point for creating a custom style or component that handles user input data with the `UserInput` service is the style `showUserInput`. It might make sense to use this style as a template for building a more complex style.'),
