(0000000433, 0000000025, 0000000003, 0000000001, 'The source code of the project is hosted on [TPF GitLab](http://phhum-a209-cp.unibe.ch:10012/SLP/SLP-sleep_coach). In order to make changes to the code a user account needs to be created. Request a GitLab account by contacting a [TPF member](http://www.philhum.unibe.ch/forschung/tpf/index_ger.html).\r\n\r\n### Version Control with Git\r\nIf you are not familiar with version control of source code with git please refer to the [git homepage](https://git-scm.com/).\r\nThe interface with git can easily be done via command line.\r\nIf this is not your cup of tea, several [GUI Clients](https://git-scm.com/downloads/guis) are available.\r\n\r\n### Extending/Changing the Source Code\r\nChanges to the code **should not** be made on the server as only deploy rights are given and the changes cannot be pushed to GitLab.\r\nInstead a development environment on a local machine should be created where the source code is changed (In the following the name `__experiment_name__` denotes the name of the project):\r\n\r\n1. To set up a local development environment.\r\nRefer to https://selfhelp.psy.unibe.ch/demo/configs for some guidance on this topic.\r\n\r\n2. Clone the project from the [TPF server](http://phhum-a209-cp.unibe.ch:10012/SLP/SLP-sleep_coach).\r\n```\r\ngit clone gh@tpf.fluido.as:SLP/SLP-sleep_coach.git __experiment_name__\r\n```\r\n\r\n3. Create a feature branch where the changes will be implemented.\r\n```\r\ngit branch app-__experiment_name__\r\n```\r\n\r\n4. Implement the extensions.\r\nTry to avoid making changes to the existing code.\r\nWhen adding new styles or components, no changes to the existing code need to be made as everything new should be kept in the folder named after the new style or component.\r\nIt is highly recommened to use git while developing and regularly committing changes to the local tree and pushing the changes to TPF GitLab. Refer to [Getting Started](https://git-scm.com/book/en/v1/Getting-Started) for help on how to use git.\r\nNote that changes to the database should be included in the source code as well.\r\nIt is good practice to provide an sql script including the necessary changes.\r\n\r\n5. Once the changes are ready and tested the new version can be deployed on the server (assuming the local changes wre pushed to TPF GitLab).\r\nOn the webserver this can be done with the following commands (in the project directory)\r\n```\r\ngit pull\r\ngit co app-__experiment_name__\r\n```\r\nRemember to also apply the database update script if changes to the database were made.\r\nMake sure to test the script on a local copy of the life database before deploying it on the server.\r\n\r\n### Merging to the Master Branch\r\nIf the changes seem to be a valid addon for other projects as well, it might make sense to merge the work into the master branch.\r\nThis can be requested by creating a [Merge Request](http://phhum-g111-nns.unibe.ch:10012/SLP/SLP-sleep_coach/merge_requests) in GitLab.\r\nA member of the TPF team will then perform a code review and accept or reject the merge request.\r\nIt is likely that a new style or component will be accepted. However, it is less likely that extensive changes to the existing code might be considered.'),
