(0000000456, 0000000023, 0000000001, 0000000001, ''),
(0000000456, 0000000025, 0000000003, 0000000001, 'A wrapper is a style that allows to group child elements. Wrappers can have a visual component or can be invisible. Visible wrapper are useful to provide some structure in a document while invisible wrappers serve merely as a grouping option . The latter can be useful in combination with CSS classes. The following wrappers are available:\r\n\r\n- `alert` is **visible** wrapper that draws a solid, coloured box around its content. The text colour of the content is changed according to the type of alert.\r\n- `card` is a versatile **visible** wrapper that draws a fine border around its content. A card can also have a title and can be made collapsible.\r\n- `conditionalContainer` is a **invisible** wrapper which has a condition attached. The content of the wrapper is only displayed if the condition is true.\r\n- `container` is an **invisible** wrapper.\r\n- `div` allows to wrap its children in a simple `<div>` tag. This allows to create more complex layouts with the help of bootstrap classes.\r\n- `jumbotron` is a **visible** wrapper that wraps its content in a grey box with large spacing.\r\n- `navigationContainer` is an **invisible** wrapper and is used specifically for navigation pages.\r\n- `quiz` is a predefined assembly of tabs, intended to ask a question and provide a right and wrong answer tab.\r\n- `tabs` is a **visible** wrapper that allows to group content into tabs and only show one tab at a time. It requires `tab` styles as its immediate children. Each `tab` then accepts children which represent the content of each tab.'),
(0000000457, 0000000023, 0000000001, 0000000001, '');
INSERT INTO `sections_fields_translation` (`id_sections`, `id_fields`, `id_languages`, `id_genders`, `content`) VALUES
(0000000457, 0000000025, 0000000003, 0000000001, 'Text styles allow to control how text is displayed. These styles are used to create the main content. The following styles are available:\r\n\r\n\r\n- `heading` is used to display the 6 levels of HTML headings.\r\n- `markdown` is the bread-and-butter style which allows to style content in a very flexible way. In addition to markdown syntax, pure HTML statements are allowed which makes this style very versatile. It is recommended to limit the usage of HTML to a minimum in order to keep the layout of the webpage consistent.\r\n- `markdownInline` is similar to the markdown style but is intended for one-line text where emphasis is required.\r\n- `plaintext` renders simple text. No special syntax is allowed here.\r\n- `rawText` renders text in a mono-space font which makes it useful to display code.'),
(0000000458, 0000000023, 0000000001, 0000000001, ''),
(0000000458, 0000000025, 0000000003, 0000000001, 'Link styles allow to render different types of links:\r\n\r\n- `button` renders a button-style link with several predefined colour schemes.\r\n- `link` renders a standard link but allows to open the target in a new tab.\r\n\r\nLinks can refer to elements within the WebApp.\r\nUse the following syntax to achieve this:\r\n - link to back (browser functionality) `#back`\r\n - link to the last unique visited page `#last_user_page`\r\n - link to asset `%asset_name`\r\n - link to page `#page_name`\r\n - link to anchor on page `#page_name#wrapper_name`\r\n - link to root_section on a nav_page `#nav_page_name/nav_section_name`\r\n - link to anchor on root_section on nav_page `#nav_page_name/nav_section_name#wrapper_name`'),
(0000000459, 0000000022, 0000000003, 0000000001, 'Button'),
(0000000459, 0000000023, 0000000001, 0000000001, ''),
(0000000459, 0000000025, 0000000003, 0000000001, '# Style `button`'),
(0000000460, 0000000022, 0000000003, 0000000001, 'Link'),
(0000000460, 0000000023, 0000000001, 0000000001, ''),
