(0000000461, 0000000023, 0000000001, 0000000001, ''),
(0000000461, 0000000025, 0000000003, 0000000001, 'The field `url` specifies the target url of the link. Note that if this field is left empty the link is not rendered.\r\nThe field `label` defines the rendered text which will be clickable.\r\nIf left empty the value specified in the field `url` will be used as label.\r\n\r\nThe field `open_in_new_tab` specifies whether the target is opened in a new tab or in the current tab.'),
