(0000000470, 0000000023, 0000000001, 0000000001, ''),
(0000000470, 0000000025, 0000000003, 0000000001, 'An form input field (form-field) must be placed inside a form wrapper. An form-field allows a user to enter data and submit these to the server. The chosen form wrapper decides what happens with the submitted data. The following from-field styles are available:\r\n\r\n- `input` is a one-line form-field style that allows to enter different types of data (e.g. text, color, time, date, checkbox).\r\n- `radio` allows to predefine a set of options for the user to select. It provides a list of options where only one option can be chosen.\r\n- `select` is a form-field style that provides a predefined set of choices which can be selected with a dropdown menu. In contrast to the `radio` style the `select` style has a different visual appearance and provides a list of options where also multiple options can be chosen.\r\n- `slider` is an extension of the style `input` of type range. It allows to provide a label for each position of the slider.\r\n- `textarea` is a multi-line from-field style that allows to enter multiple lines of text.\r\n\r\n\r\nAll form-fields require a field `name` which defines the name of the from-field and is used to identify the value corresponding to the form-field, once the value is transmitted. If the field `name` is left empty the form-field will not be rendered.\r\n\r\nFurther, all form-fields support the field `value` which defines the default value of the form-field and the field `label` which defines the text that is rendered above the form-field. If `label` is left empty the form-field is rendered without any margins.\r\n\r\nFinally, all form-fields support the field `is_required`. If it is set, the form-field is marked as required and will, depending on the browser support, be highlighted as faulty on submit if left empty.'),
