(0000000480, 0000000023, 0000000001, 0000000001, ''),
(0000000480, 0000000025, 0000000003, 0000000001, 'The style `formUserInput` allows to create html forms where user input is automatically stored to the database.\r\n\r\nThere are two ways of how user data is stored to the database automatically. This can be controlled with the field `is_log`:\r\n- With `is_log = false` data is continuously updated. In this case an input field always shows the current, user-specific content and whenever this content is changed by the user, the old values are overwritten in the database. This way of storing data is intended\r\nfor entries where data is constantly edited and revised.\r\n- With `is_log = true` data is stored incrementally. In this case each time a set of data is submitted to the server, a timestamp is attached to the data. For each submission a new entry is created in the database which allows to store multiple entries, made\r\nat different points in time. This way of storing the data is intended for log-like forms where a user is asked to enter\r\na specific set of data every day.\r\n\r\nThe field `name` is essential as the name of a form can later be used to get the stored data associated to the from the database.\r\n\r\nThe field `label` defines the text on the submit button.\r\n\r\nThe field `alert_success` defines the text that is displayed upon successful storage of the data.\r\n\r\nThere are two ways of how user data is submitted to the server. This can be controlled with the field `ajax`:\r\n- With `ajax = false` the data is submitted to the server with a full page reload. \r\n- With `ajax = true` the data is submitted with AJAX request and once the data is saved only some components are refreshed and the page is not fully reloaded. In this way the state of opened cards, tabs, etc can be kept.'),
