(0000000489, 0000000025, 0000000003, 0000000001, 'The style `showUserInput` can be used to fetch user input and display it on the screen. As with the style `formUserInput`, the field `is_log` is used to specify whether multiple entries must be fetched (`is_log` checked) or only one single entry is available (`is_log` unchecked).\r\n\r\nThe style `showUserInput` is a datatable now. By default all functionality is\r\n   stripped. If you want to add configuration you have to use css classes in\r\n   the `showUserInput` form\r\n    - `dt-sortable` - make all column sortable\r\n    - `dt-searching` - add the search field\r\n    - `dt-bPaginate` - add the page grouping\r\n    - `dt-bInfo` - add the info footer\r\n    - `dt-order-0-asc`, `dt-order-1-desc` - order the desired column asc or desc\r\n    - `dt-hide-0` - hide the desired column'),
