(0000000503, 0000000025, 0000000003, 0000000001, 'The style `div` is a simple invisible wrapper that can be used organise elements freely on the page. This is very versatile in combination with [Bootstrap](https://getbootstrap.com/docs/4.2/getting-started/introduction/) classes (or any custom made style-sheet).\r\n\r\nIn the following some simple examples are shown where [Bootstrap](https://getbootstrap.com/docs/4.2/getting-started/introduction/) classes are used to arrange elements. For the sake of presentation the `div` wrappers are coloured such that it is possible to see how the wrappers are aranged.\r\n\r\nNote that a lot of Bootstrap classes can be used with the `div` style (not only grid classes). In fact, a lot of the styles that are available within the WebApp are based on nested divs.'),
(0000000504, 0000000022, 0000000003, 0000000001, 'Using `div` Styles and Grid Classes from Bootstrap'),
