INSERT INTO `sections_fields_translation` (`id_sections`, `id_fields`, `id_languages`, `id_genders`, `content`) VALUES
(0000000591, 0000000022, 0000000003, 0000000001, 'Login'),
(0000000591, 0000000023, 0000000001, 0000000001, ''),
(0000000591, 0000000025, 0000000003, 0000000001, '# Style `login`'),
(0000000592, 0000000022, 0000000003, 0000000001, 'Register'),
(0000000592, 0000000023, 0000000001, 0000000001, ''),
(0000000592, 0000000025, 0000000003, 0000000001, '# Style `register`'),
(0000000593, 0000000022, 0000000003, 0000000001, 'Chat'),
(0000000593, 0000000023, 0000000001, 0000000001, ''),
(0000000593, 0000000025, 0000000003, 0000000001, '# Style `chat`'),
(0000000594, 0000000022, 0000000003, 0000000001, 'Validate'),
(0000000594, 0000000023, 0000000001, 0000000001, ''),
(0000000594, 0000000025, 0000000003, 0000000001, '# Style `validate`'),
(0000000595, 0000000022, 0000000003, 0000000001, 'ResetPassword'),
(0000000595, 0000000023, 0000000001, 0000000001, ''),
(0000000595, 0000000025, 0000000003, 0000000001, '# Style `resetPassword`'),
(0000000596, 0000000022, 0000000003, 0000000001, 'Profile'),
(0000000596, 0000000023, 0000000001, 0000000001, ''),
(0000000596, 0000000025, 0000000003, 0000000001, '# Style `profile`'),
(0000000597, 0000000023, 0000000001, 0000000001, ''),
(0000000597, 0000000025, 0000000003, 0000000001, 'The admin styles are for user registration and access handling.\r\nThe following styles are available:\r\n\r\n- `chat` provides the user interface to enable communication between a subject and a therapist.\r\n- `login` provides a small form where the user can enter his or her email and password to access the WebApp. It also includes a link to reset a password.\r\n- `profile` enables a user to configure his or her user account.\r\n- `register` provides a small form to allow a user to register for the WebApp. In order to register a user must provide a valid email and activation code. Activation codes can be generated in the admin section of the WebApp. The list of available codes can be exported.\r\n- `resetPassword` provides the form for a user to reset the password.\r\n- `validate` provides to form for a user to validate his or her email address.'),
(0000000598, 0000000023, 0000000001, 0000000001, ''),
(0000000598, 0000000025, 0000000003, 0000000001, 'By default, an instance of the style `chat` can be found in the page `contact`.\r\nThe style offers the following fields to customize the text that is displayed to the user.\r\n\r\n- `alert_fail`: The here defined text will be displayed in an danger-alert-box if it was not possible to send the message. If this alert is shown there is probably an issue with the server.\r\n- `alt`: This message is displayed to a user in the role `Therapist` if no `Subject` is selected.\r\n- `label_lobby`: The name of the root chat room (the room every user is part of).\r\n- `label_new`: This text is used as a divider between messages that are already read and new messages.\r\n- `label_submit`: The text on the submit button.\r\n- `title_prefix`: This is the first part of the text that is displayed in the message card header. The second part of this text depends on the role of the user.\r\n- `experimenter`: This is the second part of the message card header if the role of the user is `Therapist`.\r\n- `subjects`: This is the second part of the message card header if the role of the user is `Subject`.\r\n\r\nNote that the chat interface changes slightly depending on the role of a user. For a more detailed description on how chat roles differ, refer to the documentation in `Admin/Chat Rooms` of your Selfhelp WebApp.\r\n\r\nNote that a user can choose to get an email when a new message is sent to him or her.  The content of this email can be customized in `Admin/Email CMS` (`email_notification`).'),
(0000000600, 0000000023, 0000000001, 0000000001, ''),
(0000000600, 0000000025, 0000000003, 0000000001, 'By default, an instance of the style `login` can be found on the page `login`.\r\nThe style offers the following fields to customize the text that is displayed to the user.\r\n\r\n- `type`: This allows to choose the colour scheme for the login form.\r\n- `alert_fail`: This text is displayed in a danger-alert-box whenever the login fails.\r\n- `label_login`: The text on the login button.\r\n- `label_pw`: The placeholder in the password input field.\r\n- `label_pw_reset`: The name of the password reset link.\r\n- `label_user`: The placeholder in the email input field.\r\n- `login_title`: The text displayed in the login card header.'),
(0000000601, 0000000023, 0000000001, 0000000001, ''),
(0000000601, 0000000025, 0000000003, 0000000001, 'By default, an instance of the style `register` can be found on the page `login`.\r\nThe style offers the following fields to customize the text that is displayed to the user.\r\n\r\n- `type`: This allows to choose the colour scheme for the register form.\r\n- `alert_fail`: This text is displayed in a danger-alert-box whenever the registration fails.\r\n- `alert_success`: Upon successful registration the registration form is replaced with a `jumbotron` which hold this text.\r\n- `label_pw`: The placeholder in the validation code input field.\r\n- `label_submit`: The text on the registration button.\r\n- `label_user`: The placeholder in the email input field.\r\n- `success`: Upon successful registration the registration form is replaced with a `jumbotron` which holds this text as a heading.\r\n- `title`: The text displayed in the register card header.\r\n- `group`: Select the default group in which every new registered user will be assigned. \r\n- `open_registration`: If `open_registration` is selected, then users can register without entering a code. Once they register a code will be generated for them. If it is not selected, then every new user needs a code provided by the researchers.\r\n\r\nNote that the content of the email which is sent to the user can be customized in `Admin/Email CMS` (`email_activate`).'),
(0000000602, 0000000023, 0000000001, 0000000001, ''),
(0000000602, 0000000025, 0000000003, 0000000001, 'By default, an instance of the style `profile` can be found on the page `profile-link/profile`. The style offers the following fields to customize the text that is displayed to the user.\r\n\r\n- `alert_del_fail`: This text will be displayed if a user wants to delete his or her account but the operation failed.\r\n- `alert_del_success`: This text will be displayed upon successful deletion of a user account. \r\n- `alert_fail`: This text will be displayed if a user was unable to change his settings.\r\n- `alert_success`: This text will be displayed upon successful change of user settings. \r\n- `children`: This field holds the main structure of the profile page content. Styles were used to construct this in order to keep the layout consistent. In order to change specific aspects of the profile page, navigate through the children and make changes where needed.'),
(0000000603, 0000000023, 0000000001, 0000000001, ''),
(0000000603, 0000000025, 0000000003, 0000000001, 'By default, an instance of the style `resetPassword` can be found on the page `resetPassword`. This page is reached when clicking the reset password link in the `login` style. The style offers the following fields to customize the text that is displayed to the user.\r\n\r\n- `alert_fail`: This text is displayed in a danger-alert-box if the email to reset the password could not be sent to the user.\r\n- `alert_success`: Upon successful reset operation the reset password form is replaced with a `jumbotron` which hold this text.\r\n- `label_login`: The text on the link pointing to the login page.\r\n- `label_pw_reset`: The text on the submission button to reset the password.\r\n- `placeholder`: The placeholder of the email input field.\r\n- `success`: Upon successful reset operation the reset password form is replaced with a `jumbotron` which holds this text as a heading.\r\n- `text_md`: The text describing to the user how the process of resetting the password works.\r\n\r\nNote that the content of the email which is sent to the user can be customized in `Admin/Email CMS` (`email_reset`).'),
(0000000604, 0000000023, 0000000001, 0000000001, ''),
(0000000604, 0000000025, 0000000003, 0000000001, 'By default, an instance of the style `validate` can be found in the page `validate`. The style offers the following fields to customize the text that is displayed to the user.\r\n\r\n- `name`: The validate style allows to add custom input fields in order to collect further data about the user. This data is stored in the database like any other user input. The content of the field `name` will be used in the column `form_name` of the user data export (in the menu `Admin/Export`) for all custom validation input fields.\r\n- `alert_fail`: This text is displayed in an danger-alert-box if the validation fails.\r\n- `alert_success`: On successful validation a new page appears where the content of this field is displayed in a `jumbotron`.\r\n- `gender_female`: The label next to the female radio button option.\r\n- `gender_male`: The label next to the male radio button option.\r\n- `label_activate`: The text on the submit button to activate the user account.\r\n- `label_gender`: The label above the gender selection radio buttons.\r\n- `label_login`: The text on the back to login link on the success page.\r\n- `label_name`: The label above the username input field.\r\n- `label_pw`: The label above the password input fields.\r\n- `label_pw_confirm`: The placeholder for the password confirmation input field.\r\n- `name_placeholder`: The placeholder for the username input field.\r\n- `pw_placeholder`: The placeholder for the password input field.\r\n- `subtitle`: The text in the card header of the validation form.\r\n- `success`: On successful validation a new page appears where the content of this field is displayed in as a heading in a `jumbotron`.\r\n- `name_description`: The small description text below the username input field. \r\n- `title`: The title of the validation page.\r\n- `children`: This field is intended for custom input fields that allow the collect further information about a user (also see field `name`).'),
(0000000605, 0000000022, 0000000003, 0000000001, 'Json'),
(0000000605, 0000000023, 0000000001, 0000000001, ''),
(0000000605, 0000000025, 0000000003, 0000000001, '# Style `json`'),
(0000000606, 0000000023, 0000000001, 0000000001, ''),
(0000000606, 0000000025, 0000000003, 0000000001, 'The style `json` allows to specify nested base styles as a JSON string.\r\n\r\nThere are a few things to note:\r\n - the key `_baseStyle` must be used to indicate that the assigned object is a *style object*\r\n - the *style object* must contain the key `_name` where the value must match a style name\r\n - the *style object* must contain the key `_fields` where the value is an object holding all required fields of the style (refer to the <a href=\"https://selfhelp.psy.unibe.ch/demo/styles\" target=\"_blank\">style documentation</a> for more information)\r\n\r\nFor example, the following syntax allows to define a alert style wrapping a markdown style:\r\n\r\n```json\r\n{\r\n    \"_baseStyle\": {\r\n        \"_name\": \"alert\",\r\n        \"_fields\": {\r\n            \"type\": \"success\",\r\n            \"is_dismissable\": true,\r\n            \"children\": [{\r\n                \"_baseStyle\": {\r\n                    \"_name\": \"markdownInline\",\r\n                    \"_fields\": {\r\n                        \"text_md_inline\": \"This is **bold**\"\r\n                    }\r\n                }\r\n            }]\r\n        }\r\n    }\r\n}\r\n```'),
(0000000607, 0000000022, 0000000003, 0000000001, 'An Example'),
(0000000607, 0000000023, 0000000001, 0000000001, 'mt-3'),
(0000000607, 0000000028, 0000000001, 0000000001, 'light'),
(0000000607, 0000000046, 0000000001, 0000000001, '1'),
(0000000607, 0000000047, 0000000001, 0000000001, '0'),
(0000000607, 0000000048, 0000000001, 0000000001, ''),
(0000000608, 0000000023, 0000000001, 0000000001, ''),
(0000000608, 0000000105, 0000000003, 0000000001, '{\r\n    \"_baseStyle\": {\r\n        \"_name\": \"alert\",\r\n        \"_fields\": {\r\n            \"type\": \"success\",\r\n            \"is_dismissable\": true,\r\n            \"children\": [{\r\n                \"_baseStyle\": {\r\n                    \"_name\": \"markdownInline\",\r\n                    \"_fields\": {\r\n                        \"text_md_inline\": \"This is **bold**\"\r\n                    }\r\n                }\r\n            }]\r\n        }\r\n    }\r\n}'),
(0000000609, 0000000023, 0000000001, 0000000001, ''),
(0000000609, 0000000025, 0000000003, 0000000001, 'The following was created by using the style `json` and the code described above.'),
