(0000000613, 0000000023, 0000000001, 0000000001, ''),
(0000000613, 0000000025, 0000000003, 0000000001, 'With a little the help of the functionality provided by the [`json` style](#style/json-navigationContainer), it is possible to render images (or any other style fro that matter) next to the radio buttons instead of simple text.\r\n\r\nUsing the following code in the `items` field of the style `radio` a list of a radio buttons with images can be generated:\r\n```json\r\n[{\r\n  \"value\":\"1\",\r\n  \"text\": { \"_baseStyle\": {\"_name\": \"image\", \"_fields\": {\r\n    \"alt\": \"test\",\r\n    \"title\": \"Test\",\r\n    \"source\": \"https://via.placeholder.com/200x30\"\r\n  }}}\r\n},\r\n{\r\n  \"value\":\"2\",\r\n  \"text\": { \"_baseStyle\": {\"_name\": \"image\", \"_fields\": {\r\n    \"alt\": \"test\",\r\n    \"title\": \"Test\",\r\n    \"source\": \"https://via.placeholder.com/200x30\"\r\n  }}}\r\n},\r\n{\r\n  \"value\":\"3\",\r\n  \"text\": { \"_baseStyle\": {\"_name\": \"image\", \"_fields\": {\r\n    \"alt\": \"test\",\r\n    \"title\": \"Test\",\r\n    \"source\": \"https://via.placeholder.com/200x30\"\r\n  }}}\r\n}]\r\n```\r\n\r\nNote that compared to the `json` example presented in the introduction, now the key `\"text\"` has an object with special syntax as explained in the [`json` style](#style/json-navigationContainer).\r\n\r\nIn the following, the output of this example is rendered (with field `is_inline` checked).'),
