(0000000627, 0000000022, 0000000003, 0000000001, 'UserProgress'),
(0000000627, 0000000023, 0000000001, 0000000001, ''),
(0000000627, 0000000025, 0000000003, 0000000001, '# Style `userProgress`'),
(0000000628, 0000000023, 0000000001, 0000000001, ''),
(0000000628, 0000000025, 0000000003, 0000000001, 'The style `userProgress` is based on the style `progressBar`. It supports the same configuration options as the style [`progressBar`](#style/progressBar-navigationContainer) except for the fields `count` and `max_count` as these fields are filled in automatically:\r\n - `max_count`: 100\r\n - `count`: The percentage of the user progress\r\n\r\nThe user progress is computed by adding up all experiment pages and navigation sections visited by the user at least once, divided by the total count of experiment pages and navigation sections.'),
