(0000000630, 0000000023, 0000000001, 0000000001, ''),
(0000000630, 0000000025, 0000000003, 0000000001, 'Graph styles allow to draw graps and diagrams based on static (uploaded assets) or dynamic (user input) data. All graphs are based on the [Plotly.js](https://plotly.com/javascript/) graph library.\r\n\r\n- `graph`: The most general graph style which allows to render a vast variety of graphs but requires extensive configuration. All other graph styles are based on this style.\r\n- `graphBar`: Create a bar diagram from user input data or imported static data.\r\n- `graphLegend`: Render colored list of items. This can be used to show one global legend for multiple graphs.\r\n- `graphPie`: Create a pie diagram from user input data or imported static data.\r\n- `graphSankey`: Create a Sankey diagram from user input data or imported static data.'),
