(0000000699, 0000000023, 0000000001, 0000000001, ''),
(0000000699, 0000000025, 0000000003, 0000000001, 'A wrapper style of the more general style [`graph`](#style/base-graph-navigationContainer). The style `graphBar` allows to draw simple bar graphs using either statically uploaded data or dynamic user input data (collected from the style [`formUserInput`](#style/formUserInput-navigationContainer)).\r\n\r\nThe bar graph is rendered from a specific form input field or data table column. This is specified by the fields `data-source` and `name` where the former indicates the source form or table and the latter the form input field or table column. Each occurrence of a distinct data value is counted and represented as a bar.\r\n\r\nTo provide labels and colors the field `value_types` can be used. To further customize the graph the fields `layout` and `config` are available. Refer to the [Documentation of Plotly.js](!https://plotly.com/javascript/) for more information on the available options.\r\n\r\nIf more elaborate operations than counting the values are required use the more general style [`graph`](#style/base-graph-navigationContainer) to render the bar graph.'),
