(0000000703, 0000000025, 0000000003, 0000000001, 'A wrapper style of the more general style [`graph`](#style/base-graph-navigationContainer). The style `graphPie` allows to draw simple pie graphs using either statically uploaded data or dynamic user input data (collected from the style [`formUserInput`](#style/formUserInput-navigationContainer)).\r\n\r\nThe pie graph is rendered from a specific form input field or data table column. This is specified by the fields `data-source` and `name` where the former indicates the source form or table and the latter the form input field or table column. Each occurrence of a distinct data value is represented as a percentage value in the pie.\r\n\r\nTo provide labels and colors the field `value_types` can be used. To further customize the graph the fields `layout` and `config` are available. Refer to the [Documentation of Plotly.js](!https://plotly.com/javascript/) for more information on the available options.'),
