(0000000713, 0000000025, 0000000003, 0000000001, 'The following example show how to customize the hover text as well as the text shown on the graph. To do this the fields `hoverinfo` and `textinfo` can be used. The value of each respective field is described in the title of each graph. The title is defined with the key `title` in the field `layout`. Note that the newline in the title can be achieved by using the string `&lt;br&gt;` which translates to the HTML newline tag `<br>`.\r\n\r\nFor all graphs the legend is disabled and the margin is reduced to save some space. This is achieved by setting the field `layout` to\r\n```\r\n{\r\n  \"showlegend\": false,\r\n  \"margin\": { \"l\": 40, \"r\": 40 }\r\n}\r\n```\r\nFurther, the graph menu bar was disabled by setting the field `config` to\r\n```\r\n{\r\n  \"displayModeBar\": false\r\n}\r\n```'),
