(0000000724, 0000000025, 0000000003, 0000000001, 'The style `graphSanky` builds upon the base style [`graph`](#style/base-graph-navigationCOntainer) but cannot be replaced by the base style (as is the case for [`graphPie`](#style/graphPie-navigationContainer) and [`graphBar`](#style/graphBar-navigationContainer)). It offers functionality the base style cannot offer due to the special nature of Sankey diagrams.\r\n\r\nA Sankey diagram is based on either statically uploaded data or dynamic user input data (collected from the style [`formUserInput`](#style/formUserInput-navigationContainer)). The diagram is computed from multiple data sets, i.e. table columns in static data or user input fields in dynamic data. For details refer to the descriptions of the fields `value_types` and `form_field_names`. '),
