(0000000735, 0000000025, 0000000003, 0000000001, 'The following example illustrates a Sankey diagram when using the default configuration proposed by Plotly. This is achieved with enabling the field `has_type_labels` and disabling the fields `has_field_labels` and `is_grouped`.'),
(0000000736, 0000000023, 0000000001, 0000000001, ''),
(0000000736, 0000000025, 0000000003, 0000000001, 'The style `graph` is wrapper for the library [Plotly.js](!https://plotly.com/javascript/) which allows to use collected data from SelfHelp to render graphs. For simple bar or pie graphs it is recommend to use the styles `graphBar` or `graphPie`, respectively, as they are much easier to configure. For Sankey diagrams it is recommended to use the style `graphSankey` as it is much easier to set up and offers options which are not achievable with the base `graph` style.\r\n\r\nThe style fields `config` and `layout` expect a JSON object which corresponds to the [configuration object](!https://plotly.com/javascript/configuration-options/)  and the [layout object](!https://plotly.com/javascript/reference/#layout) passed to the graph library, respectively.\r\n\r\nThe style field `traces` expects a JSON list of trace objects. This corresponds to the data array which is passed to the graph library. However, in order to link SelfHelp data to graphs, each trace object is extended with a special key `data_source` (Refer to the cards below for more information and examples). All other keys are dependent on the type of figure to be drawn and can be referred to in the [Plotly.js documentation](!https://plotly.com/javascript/reference/).\r\n\r\nThe style field `data_config` expects a JSON list. In the JSON, we can define how we would like to extract some data from DB and load into the traces. JSON Structure:\r\n ```\r\n [\r\n	{\r\n		\"type\": \"static|dynamic\",\r\n		\"table\": \"table_name | #url_param1\",\r\n        \"retrieve\": \"first | last | all\",\r\n		\"fields\": [\r\n			{\r\n				\"field_name\": \"name | #url_param2\",\r\n				\"field_holder\": \"@field_1\",\r\n				\"not_found_text\": \"my field was not found\"				\r\n			}\r\n		]\r\n	}\r\n]\r\n```\r\n\r\nExample: \r\n ```\r\n [\r\n	{\r\n		\"type\": \"static\",\r\n		\"table\": \"my_table\",\r\n        \"retrieve\": \"first\",\r\n		\"fields\": [\r\n			{\r\n				\"field_name\": \"my_field\",\r\n				\"field_holder\": \"@field_holder\",\r\n				\"not_found_text\": \"my field was not found\"				\r\n			}\r\n		]\r\n	}\r\n]\r\n```\r\n\r\nIt means that the code will search the first row in table `my_table` and it will get the value of field `my_field`. Then the value will be assigned and if keyword `@field_holder` is used in `traces`, it will be replaced with the found value. If no value was found it will return the predefined string `not_found_text`.\r\n\r\nThe data to be used to render the graphs can be of either of the two following types.\r\n- `dynamic`: The data is collected through the selfhelp style `formUserInput` or `mermaidForm`. A *data collection* corresponds to all data points collected through one specific form. A *data set* corresopnds to all data points collected through a specific input field of a form.\r\n- `static`: The data was collected through other means than SelfHelp and was uploaded to the SelfHelp platform as a CSV file. A *data collection* corresponds to all data points within a CSV file. A *data set* corresponds to one column of a CSV file.'),
