(0000000738, 0000000025, 0000000003, 0000000001, 'The key `data_source` of a trace object expects a JSON object with the following keys:\r\n\r\n- `name`: the name of the data collection.\r\n- `map`: the association of the data points to plotly trace keys.\r\n  Each key is a dot-separated string which will produce an element inside the trace object accordingly.\r\n  For example, the string `marker.color` will extend the trace object with the key `marker`.\r\n  This key will hold an object with the key `color` which will hold a list of data items to be used to color the markers of the trace.\r\n  The values of the map object can be of the following types:\r\n   - `string`: indicating the data column to be used as values.\r\n   - `array`: an array of operand objects which allow to perform simple\r\n     operations on data columns and use the results as values.\r\n   - `object`: an object defining how to group values of one data column and\r\n     how to assign properties to each group.\r\n'),
(0000000739, 0000000022, 0000000003, 0000000001, 'String Trace Association'),
(0000000739, 0000000023, 0000000001, 0000000001, 'mt-3'),
(0000000739, 0000000028, 0000000001, 0000000001, 'light'),
(0000000739, 0000000046, 0000000001, 0000000001, '1'),
(0000000739, 0000000047, 0000000001, 0000000001, '0'),
(0000000739, 0000000048, 0000000001, 0000000001, ''),
(0000000740, 0000000023, 0000000001, 0000000001, ''),
(0000000740, 0000000025, 0000000003, 0000000001, 'This example uses a static data collection (`sample_static`) with a string trace association to render a scatter plot. Here, two traces are rendered where for each trace all data points from one data set (`trace1` and `trace2`, respectively) are used and assigned to the trace key `y`.\r\n\r\n```json\r\n[{\r\n  \"name\": \"Trace 1\",\r\n  \"data_source\": {\r\n    \"name\": \"sample_static\",\r\n    \"map\": {\r\n      \"y\": \"trace1\"\r\n    }\r\n  }\r\n}, {\r\n  \"name\": \"Trace 2\",\r\n  \"data_source\": {\r\n    \"name\": \"sample_static\",\r\n    \"map\": {\r\n      \"y\": \"trace2\"\r\n    }\r\n  }\r\n}]\r\n```\r\n\r\nThe above JSON list will produce the following list of trace objects to be passed to the graph library:\r\n```json\r\n[{\r\n  \"name\": \"Trace 1\",\r\n  \"y\": [all data from data set `trace1`]\r\n}, {\r\n  \"name\": \"Trace 2\",\r\n  \"y\": [all data from data set `trace2`]\r\n}]\r\n```\r\n\r\nNote that the keys `name` and `y` of the trace objects correspond to the plotly trace attributes of a [scatter plot](!https://plotly.com/javascript/reference/#scatter).'),
(0000000741, 0000000022, 0000000003, 0000000001, ''),
(0000000741, 0000000023, 0000000001, 0000000001, ''),
(0000000741, 0000000123, 0000000001, 0000000001, '[\r\n  {\r\n    \"name\": \"Trace 1\",\r\n    \"data_source\": {\r\n      \"name\": \"sample_static\",\r\n      \"map\": {\r\n        \"y\": \"trace1\"\r\n      }\r\n    }\r\n  }, {\r\n    \"name\": \"Trace 2\",\r\n    \"data_source\": {\r\n      \"name\": \"sample_static\",\r\n      \"map\": {\r\n        \"y\": \"trace2\"\r\n      }\r\n    }\r\n  }\r\n]'),
(0000000741, 0000000124, 0000000003, 0000000001, ''),
(0000000741, 0000000125, 0000000001, 0000000001, ''),
(0000000742, 0000000022, 0000000003, 0000000001, 'Array Trace Association'),
(0000000742, 0000000023, 0000000001, 0000000001, 'mt-3'),
(0000000742, 0000000028, 0000000001, 0000000001, 'light'),
(0000000742, 0000000046, 0000000001, 0000000001, '1'),
(0000000742, 0000000047, 0000000001, 0000000001, '0'),
(0000000742, 0000000048, 0000000001, 0000000001, ''),
(0000000743, 0000000023, 0000000001, 0000000001, ''),
(0000000743, 0000000025, 0000000003, 0000000001, 'When performing an array association the list must hold operand objects. Each operand object specifies a data set and a mathematical operation which will be performed on all values of the data set. An operand object must have the following keys:\r\n- `name<string>`: the name of the data set\r\n- `op<string>`: one of the following mathematical operations:\r\n   - `max`: returns the maximal value of the data column.\r\n   - `min`: returns the minimal value of the data column.\r\n   - `sum`: returns the sum of all values of the data column.\r\n   - `avg`: returns the average of all values of the data column.\r\n\r\nThe following example uses a static data collection (`sample_static`) with an array trace association to render a bar plot. Here, the trace is rendered by applying a mathematical operation on all data points of each data set (trace1, trace2, and trace3, respectively).\r\n\r\n```json\r\n[{\r\n  \"data_source\": {\r\n    \"name\": \"sample_static\",\r\n    \"map\": {\r\n      \"y\": [\r\n        {\"name\": \"trace1\", \"op\": \"max\"},\r\n        {\"name\": \"trace2\", \"op\": \"avg\"},\r\n        {\"name\": \"trace3\", \"op\": \"min\"}\r\n      ]\r\n    }\r\n  },\r\n  \"x\": [\"max(Trace 1)\", \"avg(Trace 2)\", \"min(Trace 3)\"],\r\n  \"type\": \"bar\"\r\n}]\r\n```\r\n\r\nThe above JSON list will produce the following list of trace objects to be passed to the graph library:\r\n```json\r\n[{\r\n  \"x\": [\"max(Trace 1)\", \"avg(Trace 2)\", \"min(Trace 3)\"],\r\n  \"y\": [max(trace1), avg(trace2), min(trace3)],\r\n  \"type\": \"bar\"\r\n}]\r\n```\r\n\r\nNote that the keys `x`, `y`, `type` of the trace object correspond to the plotly trace attributes of a [bar graph](!https://plotly.com/javascript/reference/#bar).'),
(0000000744, 0000000022, 0000000003, 0000000001, ''),
(0000000744, 0000000023, 0000000001, 0000000001, ''),
(0000000744, 0000000123, 0000000001, 0000000001, '[{\r\n  \"data_source\": {\r\n    \"name\": \"sample_static\",\r\n    \"map\": {\r\n      \"y\": [{\"name\": \"trace1\", \"op\": \"max\"}, {\"name\": \"trace2\", \"op\": \"avg\"}, {\"name\": \"trace3\", \"op\": \"min\"}]\r\n    }\r\n  },\r\n  \"x\": [\"max(Trace 1)\", \"avg(Trace 2)\", \"min(Trace 3)\"],\r\n  \"type\": \"bar\"\r\n}]'),
(0000000744, 0000000124, 0000000003, 0000000001, ''),
(0000000744, 0000000125, 0000000001, 0000000001, ''),
(0000000745, 0000000022, 0000000003, 0000000001, 'Object Trace Association'),
(0000000745, 0000000023, 0000000001, 0000000001, 'mt-3'),
(0000000745, 0000000028, 0000000001, 0000000001, 'light'),
(0000000745, 0000000046, 0000000001, 0000000001, '1'),
(0000000745, 0000000047, 0000000001, 0000000001, '0'),
(0000000745, 0000000048, 0000000001, 0000000001, ''),
(0000000746, 0000000023, 0000000001, 0000000001, ''),
(0000000746, 0000000025, 0000000003, 0000000001, 'This is the most complex but also the most flexible way to map data collections to a plotly graph. In contrast to the array association, the object association allows to act on separate groups of values within one data set instead of action on all values of the data set. This means that one data set can be reduced to multiple values by applying mathematical operations on groups of values instead of the complete set. The object supports the following keys:\r\n\r\n- `name`: Defines the name of the data set.\r\n- `ignore`: Defines a list of value types to ignore when computing the trace value.\r\n- `options`: Allows to define post-process operations on the data set.\r\n  The following keys are available:\r\n   - `op`: Defines the operation to be used to produce grouping values.\r\n      The following operations are available:\r\n      - `count`: Count the occurences of each individual value.\r\n      - `idx`: Increment per new value type.\r\n      - `percent`: Count the occurences of each individual value and divide the result by the row count.\r\n      - `sum`: Accumulate distinct values (i.e. count * value).\r\n      - `val`: Use the value type.\r\n   - `range`: Allows to define a range to which the trace values will be evenly distributed.\r\n     The range object must contain the keys `min` and `max` to define the minimum and maximum range value, respectively.\r\n   - `factor`: If defined, this number will be multiplied to each value computed with the function defined in `op`.\r\n   - `offset`: If defined, this number will be added to each value computed with the function defined in `op` (after multiplying by `factor`).\r\n   - `round`: Defines the number of digits after the comma to round to.\r\n     0 means rounding to an integer.\r\n   - `suffix`: Allows to add a suffix to each value.\r\n- `order`: This defines the trace order and can be of the following types:\r\n   - `string`: Either \"asc\" or \"desc\" to order the traces either by ascending values or by descending values, respectively\r\n   - `array`: An array of indices indication the new position of the trace points.\r\n   - `object`: An object with the key `vals` which holds an ordered list of value types by which the traces will be ordered.\r\n- `map`: This allows to map static data to predefined keys while respecting the post-process options defined above.\r\n  The keys of the object are dot-seperated strings which will produce an element inside the trace object accordingly.\r\n  The values are map objects which will map static data to a value type.\r\n  To use this for labelling value types, the key would be the value type and the value the label to assign to the value type.\r\n- `children`. This allows to map furter data items from the data table to trace object keys while respecting the post-process options defined above.\r\n  Children are defined by a value-key pair where the key is a dot-seperated string which will produce an element inside the trace object accordingly and the value is an option object as defined by the parameter `options`.\r\n\r\nThe following example uses most of the keys described above to produce a bubble chart.\r\n\r\n```json\r\n[{\r\n  \"data_source\": {\r\n    \"name\": \"sample_static\",\r\n    \"map\": {\r\n      \"x\": {\r\n        \"name\": \"trace1\",\r\n        \"order\": \"asc\",\r\n        \"ignore\": [\"98\", \"99\"],\r\n        \"options\": {\r\n          \"op\": \"val\"\r\n        },\r\n        \"children\": {\r\n          \"text\": {\r\n            \"op\": \"percent\",\r\n            \"factor\": 100,\r\n            \"round\": 0,\r\n            \"suffix\": \"%\"\r\n          },\r\n          \"marker.size\": {\r\n            \"op\": \"percent\",\r\n            \"range\": { \"min\": 10, \"max\": 100 }\r\n          },\r\n          \"y\": {\r\n            \"op\": \"idx\"\r\n          }\r\n        },\r\n        \"maps\": {\r\n          \"hovertext\": {\r\n            \"1\": \"Type 1\",\r\n            \"2\": \"Type 2\",\r\n            \"3\": \"Type 3\",\r\n            \"4\": \"Type 4\",\r\n            \"5\": \"Type 5\",\r\n            \"6\": \"Type 6\",\r\n            \"7\": \"Type 7\",\r\n            \"8\": \"Type 8\",\r\n            \"9\": \"Type 9\",\r\n            \"10\": \"Type 10\",\r\n            \"11\": \"Type 11\",\r\n            \"98\": \"Type 98\",\r\n            \"99\": \"Type 99\"\r\n          },\r\n          \"marker.color\": {\r\n            \"1\": \"#EA8571\",\r\n            \"2\": \"#DE7C89\",\r\n            \"3\": \"#C27C9D\",\r\n            \"4\": \"#9C80A7\",\r\n            \"5\": \"#6F84A4\",\r\n            \"6\": \"#478394\",\r\n            \"7\": \"#31807A\",\r\n            \"8\": \"#38795D\",\r\n            \"9\": \"#496F42\",\r\n            \"10\": \"#59632E\",\r\n            \"11\": \"#665624\",\r\n            \"98\": \"#6D4926\",\r\n            \"99\": \"#6E3D2E\"\r\n          }\r\n        }\r\n      }\r\n    }\r\n  },\r\n  \"textposition\": \"middle center\",\r\n  \"textfont\": {\r\n    \"size\": 20\r\n  },\r\n  \"mode\": \"markers+text\"\r\n}]\r\n```\r\n\r\nThe above JSON list will produce the following list of trace objects to be passed to the graph library:\r\n```json\r\n[{\r\n  \"x\": [all distinct value types of `trace1`],\r\n  \"y\": [the index of each value type corresponding to `x`]\r\n  \"text\": [the computed percentage of each value type in `trace1`,\r\n    post-processed with `factor`, `round`, and `suffix`],\r\n  \"marker\": {\r\n    \"size\": [the computed percentage of each value type in `trace1`,\r\n      post-processed with `range`],\r\n    \"color\": [the colors to be mapped to the value types of x]\r\n  },\r\n  \"hovertext\": [the labels to be mapped to the value types of x],\r\n  \"textposition\": \"middle center\",\r\n  \"textfont\": {\r\n    \"size\": 20\r\n  },\r\n  \"mode\": \"markers+text\"\r\n}]\r\n```\r\n\r\nNote that the keys of the trace object correspond to the plotly trace attributes of a [scatter plot](!https://plotly.com/javascript/reference/#scatter).'),
