(0000000747, 0000000023, 0000000001, 0000000001, ''),
(0000000747, 0000000123, 0000000001, 0000000001, '[{\r\n  \"data_source\": {\r\n    \"name\": \"sample_static\",\r\n    \"map\": {\r\n      \"x\": {\r\n        \"name\": \"trace1\",\r\n        \"order\": \"asc\",\r\n        \"ignore\": [\"98\", \"99\"],\r\n        \"options\": {\r\n          \"op\": \"val\"\r\n        },\r\n        \"children\": {\r\n          \"text\": {\r\n            \"op\": \"percent\",\r\n            \"factor\": 100,\r\n            \"round\": 0,\r\n            \"suffix\": \"%\"\r\n          },\r\n          \"marker.size\": {\r\n            \"op\": \"percent\",\r\n            \"range\": { \"min\": 10, \"max\": 100 }\r\n          },\r\n          \"y\": {\r\n            \"op\": \"idx\"\r\n          }\r\n        },\r\n        \"maps\": {\r\n          \"hovertext\": {\r\n            \"1\": \"Type 1\",\r\n            \"2\": \"Type 2\",\r\n            \"3\": \"Type 3\",\r\n            \"4\": \"Type 4\",\r\n            \"5\": \"Type 5\",\r\n            \"6\": \"Type 6\",\r\n            \"7\": \"Type 7\",\r\n            \"8\": \"Type 8\",\r\n            \"9\": \"Type 9\",\r\n            \"10\": \"Type 10\",\r\n            \"11\": \"Type 11\",\r\n            \"98\": \"Type 98\",\r\n            \"99\": \"Type 99\"\r\n          },\r\n          \"marker.color\": {\r\n            \"1\": \"#EA8571\",\r\n            \"2\": \"#DE7C89\",\r\n            \"3\": \"#C27C9D\",\r\n            \"4\": \"#9C80A7\",\r\n            \"5\": \"#6F84A4\",\r\n            \"6\": \"#478394\",\r\n            \"7\": \"#31807A\",\r\n            \"8\": \"#38795D\",\r\n            \"9\": \"#496F42\",\r\n            \"10\": \"#59632E\",\r\n            \"11\": \"#665624\",\r\n            \"98\": \"#6D4926\",\r\n            \"99\": \"#6E3D2E\"\r\n          }\r\n        }\r\n      }\r\n    }\r\n  },\r\n  \"textposition\": \"middle center\",\r\n  \"textfont\": {\r\n    \"size\": 20\r\n  },\r\n  \"mode\": \"markers+text\"\r\n}]'),
