(0000000748, 0000000025, 0000000003, 0000000001, 'The style `filterToggle` allows to render a button which can be used to enable or disable a filter value of a data set in a data collection.\r\n\r\nThe style fields `label` and `type` are used to define the text and the color of the filter button, respectively.\r\nThe style fields `name` and `data-source` are used to define the a data set of a data collection and the field `value` defines the filter value to be matched if the filter is enabled.'),
