(0000000761, 0000000025, 0000000003, 0000000001, 'The style `filterToggleGroup` allows to render a group of buttons which can be used to enable or disable multiple filter values of a data set in a data collection. The filter values are combined with a logical OR operation, i.e. at most one value must match to consider a data point.\r\n\r\nThe style fields `labels` and `type` are used to define the text and the color of the filter buttons in the group, respectively. The fields `is_fluid` and `is_vertical` provide some control on how to render the list of buttons.\r\nThe fields `name` and `data-source` are used to define the a data set of a data collection and the field `values` defines the filter value for each button to be matched if the filter is enabled.'),
