(0000000781, 0000000023, 0000000001, 0000000001, ''),
(0000000781, 0000000025, 0000000003, 0000000001, '# CMS\r\n\r\nA content management system (CMS) is a software application that can be used to manage the creation and modification of digital content. CMSs are typically used for web content management.\r\n\r\nSelfhelp CMS features:\r\n* Group-based permission systems\r\n* Admin panel with multiple language support\r\n* Content hierarchy with unlimited depth and size\r\n* Data export\r\n* Chat communication\r\n* Qualtrics integration\r\n* Emailing\r\n* Styles (components)\r\n\r\nFor a more in-depth description of each style refer to the [documentation of the source code](https://selfhelp.psy.unibe.ch/demo/doc/doxygen/html/index.html).'),
