(0000000786, 0000000025, 0000000003, 0000000001, '# @title'),
(0000000787, 0000000022, 0000000003, 0000000001, 'Module Mail'),
(0000000787, 0000000023, 0000000001, 0000000001, ''),
(0000000787, 0000000025, 0000000003, 0000000001, '# @title\r\nThe mailing module gives you access to the mailing queue. You can monitor all scheduled emails in the queue and check their status. The queue list can be filtered from the `panel` where you can select dates and date type.\r\n\r\nClicking on a `row` in the table containment the queue entries will give you more information about the entry. If you click on the `+` sign at the first column you can see the transactions attached to the queue entry.\r\n\r\nYou can `delete` mails from the queue or `send` them earlier.\r\n\r\nMails can be scheduled from the mailing module. Click `Compose email` button.\r\n\r\nThere is a cron job running on the server every minute that check for mails to be send. This functionality can be manually execute by the button `Run now`\r\n\r\nCRON JOB scheduling\r\n  - make script `/server/cronjobs/MailQueue.php` executable (`chmod +x`). \r\n  - schedule the cronjob with `cronjob -e` and then `* * * * * php /home/www/__PROJECT_NAME__/server/cronjobs/MailQueue.php`'),
(0000000788, 0000000022, 0000000003, 0000000001, 'Module Qualtrics'),
(0000000788, 0000000023, 0000000001, 0000000001, ''),
(0000000788, 0000000025, 0000000003, 0000000001, '# @title\r\nThis module links [Qualtrics](https://www.qualtrics.com) and Selfhelp. It gives you an option to link [surveys](https://selfhelp.psy.unibe.ch/demo/cms_feature/791) from Qualtrics and visualize them in Selfhelp using the `qualtricsSurvey` style. Furthermore you can create a [project](https://selfhelp.psy.unibe.ch/demo/cms_feature/790) and add [actions](https://selfhelp.psy.unibe.ch/demo/cms_feature/792) to the project. The actions are related to a survey and gives you an opportunity to define relations between your surveys.'),
(0000000789, 0000000023, 0000000001, 0000000001, ''),
(0000000789, 0000000025, 0000000003, 0000000001, 'At the CMS preferences page you can customize some of the CMS features.\r\n\r\n- `CMS Content Language` is the **default** language for the page. If the website supports multiple languages, the selected language will be the default one to be visualized.\r\n- `Languages` - on the left side of the page you can manipulate the languages. You can create, delete and edit them.\r\n- `Callback API Key` - this is private key which is used by other applications to communicate with Selfhelp. Please do not share this key, if the key is compromised you can replace it and change it in the applications where it is used.\r\n- `moduleQualtrics` - enable or disable the Qualtrics functionality in Selfhelp\r\n- `moduleMail` - enable or disable Module Mail in Selfhelp\r\n- `moduleChat` - enable or disable the chat functionality in Selfhelp'),
(0000000790, 0000000022, 0000000003, 0000000001, 'Projects'),
(0000000790, 0000000023, 0000000001, 0000000001, ''),
(0000000790, 0000000025, 0000000003, 0000000001, '# @title\r\nBefore integrating Qualtrics surveys in Selfhelp you have to create a project. It can be done from `Module Qualtrics` then tab `Projects` and then button `Create New Project`. \r\n\r\nThe form requires:\r\n* Project name\r\n* Project description\r\n* Qualtrics API (see the image bellow)\r\n* API library ID (see the image bellow)\r\n* API mailing group (see the image bellow)\r\n\r\n\r\nEnter your Qualtrics account, then go yo your profile and on the tab Qualtrics IDs you can find the related information for your IDs and keys.\r\n\r\n'),
(0000000791, 0000000022, 0000000003, 0000000001, 'Surveys'),
(0000000791, 0000000023, 0000000001, 0000000001, ''),
(0000000791, 0000000025, 0000000003, 0000000001, '# @title\r\nIn order to link a Qualtrics `survey` to Selfhelp, we have to define it in Selfhelp. This can be done from `Admin --> Module Qualtrics` and then tab `Surveys`. Click button `Create New Survey`.\r\n\r\nThe form requires:\r\n* Survey name\r\n* Qualtrics survey id (check the image bellow)\r\n* Survey type\r\n * Baseline - this a new survey that will insert the participent information in the contacts group.\r\n * Follow up - this a follow up survey. It checks first if the participent is already in the \r\ncontacts group and only if he/she is in the contact group, the survey loads.\r\n * Anonymous - it is used for surveys that do not require a logged in user.\r\n* Group variable - if selected a group will be assigned in the survey flow and it will be send back to Selfhelp. The name of the group should be an existing `group` in Selfhelp.\r\n* Survey description\r\n* Participant variable name - this is the name of the embeded variable that will be stored in the survey. Most of the time we use **code**.\r\n* Config - Json configuration that is used for some additional functions.\r\n\r\nAfter a `survey` is created, it will appear in the table(grid) Surveys. If you want to edit or delete a `survey` you can click on the row. Then the selected `survey` entry will be loaded.\r\n\r\nOnce a survey is registered in Selfhelp it could be used by `qualtricsSurvey` style.\r\n\r\nEnter your Qualtrics account, then go yo your profile and on the tab Qualtrics IDs you can find the related information for your IDs and keys.'),
(0000000792, 0000000022, 0000000003, 0000000001, 'Actions'),
(0000000792, 0000000023, 0000000001, 0000000001, ''),
(0000000792, 0000000025, 0000000003, 0000000001, '# @title\r\nAfter you linked your Qualtrics surveys to selfhelp and created a project you can start creating `actions`. First you have to open your project. Then a button `Add Action` appears on the left side.\r\n\r\nAction form:\r\n* Action name\r\n* When survey - select the survey\r\n* Is (trigger type)\r\n * Started - the action will be executed when the survey starts\r\n * Finished - the action will be executed when the survey is finished\r\n* For group(s) - chose for which groups this action should be triggered. It means that the participant should be in this group in order to trigger the action when fills the survey.\r\n* Send\r\n * Nothing - do not send any notification or reminde\r\n * Notification - schedule a notification to be send\r\n * Reminder - schedule a reminder to be send linked to a notification\r\n* Additional functions - choose some extra specific functions that you want to be executed. These functions are very specific. Please read what they do before you chose them.'),
(0000000793, 0000000022, 0000000003, 0000000001, 'Qualtrics Synchronization'),
(0000000793, 0000000023, 0000000001, 0000000001, ''),
(0000000793, 0000000025, 0000000003, 0000000001, '# @title\r\nOnce you create a project and attach actions to it you can synchronize the surveys which are in the actions. In order to do that open the project and on the left side you can click the button `Sycn Qualtrics Surveys`. Then all surveys attached to the project will be synchronized in Qualtrics. The changes can be seen in the survey flow in the Qualtrics web page. Once a survey is synchronized and the flow is changed it should be `Published` at the Qualtrics web page. Only then the new changes to the survey will be applied.'),
(0000000794, 0000000022, 0000000003, 0000000001, ''),
(0000000794, 0000000023, 0000000001, 0000000001, ''),
(0000000794, 0000000029, 0000000001, 0000000001, '1'),
(0000000794, 0000000030, 0000000003, 0000000001, 'qualtricsAccountSettings'),
(0000000794, 0000000053, 0000000003, 0000000001, 'https://selfhelp.psy.unibe.ch/demo/assets/qualtricsAccountSettings.png'),
(0000000795, 0000000023, 0000000001, 0000000001, 'mt-3'),
(0000000795, 0000000025, 0000000003, 0000000001, 'After a project is created, it will appear in the table(grid) `Projects`. If you want to edit or delete a project you can click on the row. Then the selected `project` entry will be loaded.\r\n\r\nOnce a project is selected you can add `actions` to the project. After an action is added to the project you can `Sync Qualtrics Surveys`. Then Selfhelp finds all related surveys to the project and modifies their `Flows`. It adds a few automated steps in your survey structure. '),
(0000000796, 0000000022, 0000000003, 0000000001, ''),
(0000000796, 0000000023, 0000000001, 0000000001, ''),
(0000000796, 0000000029, 0000000001, 0000000001, '1'),
(0000000796, 0000000030, 0000000003, 0000000001, 'qualtricsAccountSettings'),
(0000000796, 0000000053, 0000000003, 0000000001, 'https://selfhelp.psy.unibe.ch/demo/assets/qualtricsAccountSettings.png'),
(0000000797, 0000000022, 0000000003, 0000000001, 'Notifications'),
(0000000797, 0000000023, 0000000001, 0000000001, ''),
(0000000797, 0000000025, 0000000003, 0000000001, '# @title\r\nSchedule info for a `notification`:\r\n* Type - currently only email. In the future we can add SMS and mobile notifications.\r\n* When - when the notification should be sent.\r\n * Immediately - the notification will be sent immediately after the survey started or finished based on the action.\r\n * On specific fixed datetime - You can pick the date and time. If the selected date was passed the notification will be sent immediately.\r\n * After time period - For example: send the notification after 2 weeks.\r\n * After time period on a weekday at given time - You can select a specific day from the week at what time should be sent. For example: send the notification on 3rd Sunday at 09:00.\r\n* From email - what will be the sending email\r\n* From name -  what will be the sending name\r\n* Replay To - the email on which the receiver can reply\r\n* To - the emails that should receive the notification. Use `;` as separator between emails. If you want to address the participant type `@user`. Then the user email will be automatically replaced when the action is triggered.\r\n* Subject - The topic of the email\r\n* Body -  The email text. It is `markdown` format.\r\n\r\nEvery scheduled notification can be seen in the `Mailing Queue`. If needed it can be deleted or send manually.'),
(0000000798, 0000000022, 0000000003, 0000000001, 'Reminders'),
(0000000798, 0000000023, 0000000001, 0000000001, ''),
(0000000798, 0000000025, 0000000003, 0000000001, '# @title\r\nSchedule info for a `reminder`:\r\n* Reminder for survey - select the survey which link was sent in the notification. We need the survey as we monitor it. If the survey is finished then if any scheduled reminders exist, they are automatically deleted.\r\n* Type - currently only email. In the future we can add SMS and mobile notifications.\r\n* When - when the notification should be sent.\r\n * Immediately - the notification will be sent immediately after the survey started or finished based on the action.\r\n * On specific fixed datetime - You can pick the date and time. If the selected date was passed the notification will be sent immediately.\r\n * After time period - For example: send the notification after 2 weeks.\r\n * After time period on a weekday at given time - You can select a specific day from the week at what time should be sent. For example: send the notification on 3rd Sunday at 09:00.\r\n*  *Reminder for notification* - this option is visible only if the reminder is sent when `After time period on a weekday at given time`. Then you have to select the notification which is related to this reminder. It is needed to recalculate the correct time for scheduling.\r\n* From email - what will be the sending email\r\n* From name -  what will be the sending name\r\n* Replay To - the email on which the receiver can reply\r\n* To - the emails that should receive the notification. Use `;` as separator between emails. If you want to address the participant type `@user`. Then the user email will be automatically replaced when the action is triggered.\r\n* Subject - The topic of the email\r\n* Body -  The email text. It is `markdown` format.\r\n\r\nEvery scheduled notification can be seen in the `Mailing Queue`. If needed it can be deleted or send manually.'),
(0000000799, 0000000022, 0000000003, 0000000001, 'Additional Functions'),
(0000000799, 0000000023, 0000000001, 0000000001, ''),
(0000000799, 0000000025, 0000000003, 0000000001, '# @title\r\n- `[Workwell] Evaluate personal strengths` - After finishing the evaluation survey, 24 attributes are send to Selfhelp. The function evaluates them and generate a PDF file which is attached to the notification or reminder. That is why a **notification** or **reminder** is required for this additional function and it should be triggered `on finished`.\r\n - Create folder with name `workwell_evaluate_personal_strenghts` in `assets`. All generated PDF files will be stored there. The folder should have `777` rights.\r\n - Upload template `workwell_evaluate_personal_strenghts.pdf` in folder assets. This the form/template that will be filled. Form example: [workwell_evaluate_personal_strenghts.pdf](https://selfhelp.psy.unibe.ch/demo/assets/workwell_evaluate_personal_strenghts.pdf)\r\n\r\n- `[Workwell] CG Action plan Week 4 (Reminder or notification is required)` - After the servery ends `workwell_cg_ap_4.pdf` template is loaded and the fields from the form are extracted. Then each field should be saved as embedded data in the Qualtrics survey. Then the value is requested from the survey and the template is filled. The function should be used on a **notification** or **reminder** and triggered **on finished**.\r\n - Create folder with name `workwell_cg_ap_4` in `assets`. All generated PDF files will be stored there. The folder should have `777` rights.\r\n - Upload template `workwell_cg_ap_4.pdf` in folder assets. This the form/template that will be filled. Form example: [workwell_cg_ap_4.pdf](https://selfhelp.psy.unibe.ch/demo/assets/workwell_cg_ap_4.pdf)\r\n\r\n- `[Workwell] CG Action plan Week 5 (Reminder or notification is required)` - After the servery ends `workwell_cg_ap_5.pdf` template is loaded and the fields from the form are extracted. Then each field should be saved as embedded data in the Qualtrics survey. Then the value is requested from the survey and the template is filled. The function should be used on a **notification** or **reminder** and triggered **on finished**.\r\n - Create folder with name `workwell_cg_ap_5` in `assets`. All generated PDF files will be stored there. The folder should have `777` rights.\r\n - Upload template `workwell_cg_ap_5.pdf` in folder assets. This the form/template that will be filled. Form example: [workwell_cg_ap_5.pdf](https://selfhelp.psy.unibe.ch/demo/assets/workwell_cg_ap_5.pdf)\r\n- `[Workwell] CG Action plan Week 4 (Reminder or notification is required)` - After the servery ends `workwell_eg_ap_4.pdf` template is loaded and the fields from the form are extracted. Then each field should be saved as embedded data in the Qualtrics survey. Then the value is requested from the survey and the template is filled. The function should be used on a **notification** or **reminder** and triggered **on finished**.\r\n - Create folder with name `workwell_eg_ap_4` in `assets`. All generated PDF files will be stored there. The folder should have `777` rights.\r\n - Upload template `workwell_eg_ap_4.pdf` in folder assets. This the form/template that will be filled. Form example: [workwell_eg_ap_4.pdf](https://selfhelp.psy.unibe.ch/demo/assets/workwell_eg_ap_4.pdf)\r\n\r\n- `[Workwell] CG Action plan Week 5 (Reminder or notification is required)` - After the servery ends `workwell_eg_ap_5.pdf` template is loaded and the fields from the form are extracted. Then each field should be saved as embedded data in the Qualtrics survey. Then the value is requested from the survey and the template is filled. The function should be used on a **notification** or **reminder** and triggered **on finished**.\r\n - Create folder with name `workwell_eg_ap_5` in `assets`. All generated PDF files will be stored there. The folder should have `777` rights.\r\n - Upload template `workwell_eg_ap_5.pdf` in folder assets. This the form/template that will be filled. Form example: [workwell_eg_ap_5.pdf](https://selfhelp.psy.unibe.ch/demo/assets/workwell_eg_ap_5.pdf)\r\n\r\n- `[BMZ] Evaluate motive` - If the function is assigned to the survey, once the survey is over, the required data is evaluated based on the survey\'s `config` and the evaluation is saved in the database. [Config example](https://selfhelp.psy.unibe.ch/demo/assets/bmz_sport.json)'),
(0000000800, 0000000023, 0000000001, 0000000001, ''),
(0000000800, 0000000025, 0000000003, 0000000001, '#Module Mail Configuration\r\nMail Queue \r\n\r\nAdd cron job: `* * * * * php home/__os_user_name__/__experiment_name__/server/cronjobs/MailQueue.php`\r\n\r\nThe Queue will be checked every minute and if a mail is scheduled it will be sent.'),
(0000000801, 0000000023, 0000000001, 0000000001, ''),
(0000000801, 0000000029, 0000000001, 0000000001, '0'),
(0000000802, 0000000022, 0000000003, 0000000001, 'Qualtrics Survey'),
(0000000802, 0000000023, 0000000001, 0000000001, ''),
(0000000802, 0000000025, 0000000003, 0000000001, '# Style `qualtricsSurvey`\r\n\r\nField `qualtricsSurvey` is a dropdown where you can select the survey that should be visualized. The dropdown list loads all registered [surveys](https://selfhelp.psy.unibe.ch/demo/cms_feature/791) in Module Qualtrics.'),
(0000000803, 0000000023, 0000000001, 0000000001, ''),
(0000000803, 0000000057, 0000000001, 0000000001, 'qualtricsSurvey'),
(0000000804, 0000000022, 0000000003, 0000000001, 'Callback Request'),
(0000000804, 0000000023, 0000000001, 0000000001, ''),
(0000000804, 0000000025, 0000000003, 0000000001, '# @title'),
(0000000805, 0000000023, 0000000001, 0000000001, ''),
(0000000805, 0000000025, 0000000003, 0000000001, 'There are times when we want to submit data to Selfhelp from another application. Then we need a callback request and a way to handle it. \r\n\r\n##### 1. System Overview\r\nAll `callback` requests must be sent to the url `/callback/[v:class]/[v:method]` where `[v:class]` is the name of a PHP class and `[v:method]` the name of a method of the class. The class and the method must be defined in the folder `server/callback/`.\r\n\r\nThe folder `server/callback/` already contains several files holding class definitions and methods which are used callbacks and can serve as examples. Note that the following two files are special utility files and should not be extended lightly:\r\n - `server/callback/BaseCallback.php`: A base class which provides easy access to services and ACL control. When creating a new Callback request class use this as parent.\r\n - `server/ajax/CallbackRequest`: A wrapper class which will\r\n    - load the correct php file\r\n    - instantiate the class indicated with the request url\r\n    - execute the callback method by passing POST parameters\r\n    - evaluate ACL as defined in the class BaseCallback\r\n    - encode the return value of the callback function as JSON\r\n\r\n##### 2. Create the Request Callback\r\nTo create a new request callback, either create a new method in an existing class or create a new class. Note that if a new class is created it must be placed in a new file and the file name must match the class name exactly and requires the `.php` file extension.\r\n\r\nThe callback method receives the php `$_POST` variable as parameter. Hence, all request data needs to be sent via POST to the server and cannot be attached as GET variables. The callback request can be protected with a callback key which is stored in [CMS preferences](https://selfhelp.psy.unibe.ch/demo/cms_feature/786) for a private callback calls or no api key check if the callback is public.'),
(0000000806, 0000000022, 0000000003, 0000000001, 'Version'),
(0000000806, 0000000023, 0000000001, 0000000001, ''),
(0000000806, 0000000025, 0000000003, 0000000001, '# Style `version`\r\nThis style visualize the database version and the application version.'),
(0000000807, 0000000023, 0000000001, 0000000001, ''),
(0000000807, 0000000029, 0000000001, 0000000001, '0'),
(0000000809, 0000000023, 0000000001, 0000000001, '');
INSERT INTO `sections_fields_translation` (`id_sections`, `id_fields`, `id_languages`, `id_genders`, `content`) VALUES
(0000000809, 0000000025, 0000000003, 0000000001, '# Plugins\r\n\r\nPlugins are additional modules that can be added to `Selfhelp`. Their functionality is project related and that is why they are not included in the main project. \r\n\r\n## Installation\r\n\r\nAll plugins are additional git projects. They can be added to a `Selfhelp` project. In your Selfhelp folder you should have a folder `server`. Inside this `server` folder you should create folder `plugins` if it does not exist. Each Selfhelp plugin should be located inside this `plugins` folder.'),
