(0000000813, 0000000025, 0000000003, 0000000001, '# @title'),
(0000000814, 0000000023, 0000000001, 0000000001, ''),
(0000000814, 0000000025, 0000000003, 0000000001, '### Description\r\n\r\nThis is a Selfhelp Plugin that is used for calculating sleepEfficiency\r\n\r\n### Installation\r\n\r\nOn the server enter your project folder. Then run `cd server/plugins`. Once you are inside folder plugins (if it does not exist, create it) run command \'git clone gh@tpf.fluido.as:SLP/sleepEfficiency.git\'. It will install the plugin inside the folder. Then run `cd sleepEfficiency` and then select the version that you want. Example `git checkout v1.0.0`. Then in folder `sleepEfficiency/db` you can find the `sql` scripts. Run them based on the version that you are. The version of the plugins can be checked on page `Impressum`.\r\n\r\n### Update\r\n\r\nCheck the version of the plugin on page `Impressum`. Then pull the latest changes on the server and select the version you need. Run the update sql scripts if there are any.\r\n\r\n### How to use it?\r\n\r\nOnce the plugin is installed it should be called by style `trigger`. A `trigger` should be attached to a style `formUserInput`. Once the form data is submitted by the user, the trigger will calculate the sleep efficiency and save it.\r\n\r\n#### Form fields\r\n- Mandatory\r\n - `entry_date` - date. For what date the user is entering data.\r\n - `TIB_1` - datetime. When the user went to bed.\r\n - `TIB_2` - datetime. When the user left the bed.\r\n - `TST_1` - datetime. When the user fall asleep.\r\n - `TST_2` - datetime. When the user wake up.\r\n - `SE` - text, hidden (css `d-none`). This field will calculate sleep efficiency.\r\n - `SE_3` - text, hidden (css `d-none`). This field will calculate average sleep efficiency for the last 3 entries.\r\n- Additional\r\n - `TIB`- text, hidden (css `d-none`). This field will calculate total time spent in bed in hours.\r\n - `TST`- text, hidden (css `d-none`). This field will calculate total time sleeping in hours.\r\n - `debug_log`- text, hidden (css `d-none`). This field will show any error if they happened during the calculations.\r\n - `SE_P` - text, hidden (css `d-none`). This field will format sleep efficiency as percentage.\r\n - `SE_3_P` - text, hidden (css `d-none`). This field will format average sleep efficiency as percentage.\r\n\r\n\r\n### [Changelog](http://phhum-a209-cp.unibe.ch:10012/SLP/sleepEfficiency/blob/master/CHANGELOG.md)'),
(0000000815, 0000000022, 0000000003, 0000000001, 'Triggers'),
(0000000815, 0000000023, 0000000001, 0000000001, ''),
(0000000815, 0000000025, 0000000003, 0000000001, '# @title'),
(0000000816, 0000000023, 0000000001, 0000000001, ''),
(0000000816, 0000000025, 0000000003, 0000000001, 'Triggers are type of style that allow some functionality to be attached when some criteria is met.\r\n- `trigger` - attach a plugin that is executed when the criteria is met.'),
(0000000817, 0000000022, 0000000003, 0000000001, 'Trigger'),
(0000000817, 0000000023, 0000000001, 0000000001, ''),
(0000000817, 0000000025, 0000000003, 0000000001, '# @title'),
(0000000818, 0000000023, 0000000001, 0000000001, ''),
(0000000818, 0000000025, 0000000003, 0000000001, 'Style `trigger` is used to call [plugins](https://selfhelp.psy.unibe.ch/demo/plugins). It can be attached to other styles and depending on the selected plugin some functionality can be executed when specific criteria is met.\r\n\r\n#### Fields\r\n- `plugin` - dropdown list with all installed plugins.');
