(0000000001, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000001, 0000000028, 'dark', 'This allows to choose the colour scheme for the login form.', 0),
(0000000002, 0000000005, NULL, 'This text will be displayed if a user was unable to change his settings.', 0),
(0000000002, 0000000006, NULL, 'This field holds the main structure of the profile page content. Styles were used to construct this in order to keep the layout consistent. In order to change specific aspects of the profile page, navigate through the children and make changes where needed.', 0),
(0000000002, 0000000019, NULL, 'This text will be displayed if a user wants to delete his or her account but the operation failed.', 0),
