(0000000002, 0000000035, NULL, 'This text will be displayed upon successful change of user settings.', 0),
(0000000003, 0000000006, NULL, 'The child sections to be added to the `container` body. This can hold any style.', 0),
(0000000003, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000003, 0000000029, '0', 'Select for a full width container, spanning the entire width of the viewport.', 0),
(0000000003, 0000000147, '0', 'If `export_pdf` is checked, the container has an export button in the top righ corner. All children in the container can be exported to a PDF file.\n\nadd class `skipPDF` to the `css` field in an element which should not be exported inthe PDF file\n\nadd class `pdfStartNewPage` to the `css` field in an element which should be on a new page\n\nadd class `pdfStartNewPageAfter` to the `css` field in an element which should insert a new page after it is loaded on the page\n', 0),
(0000000004, 0000000006, NULL, 'The child sections to be added to the `jumbotron` body. This can hold any style.', 0),
(0000000004, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000005, 0000000021, '1', 'The HTML heading level (1-6)', 0),
(0000000005, 0000000022, NULL, 'The text to be rendered as heading.', 0),
(0000000005, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000006, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000006, 0000000025, NULL, 'Use <a href=\"https://en.wikipedia.org/wiki/Markdown\" target=\"_blank\">markdown</a> syntax here.', 0),
(0000000006, 0000000146, '', 'In this ***JSON*** field we can configure a data retrieve params from the DB, either `static` or `dynamic` data. Example: \n ```\n [\n	{\n		\"type\": \"static|dynamic\",\n		\"table\": \"table_name | #url_param1\",\n        \"retrieve\": \"first | last | all\",\n		\"fields\": [\n			{\n				\"field_name\": \"name | #url_param2\",\n				\"field_holder\": \"@field_1\",\n				\"not_found_text\": \"my field was not found\"				\n			}\n		]\n	}\n]\n```\nIf the page supports parameters, then the parameter can be accessed with `#` and the name of the paramer. Example `#url_param_name`. \n\nIn order to inlcude the retrieved data in the markdown field, include the `field_holder` that wa defined in the markdown text.\n\nWe can access multiple tables by adding another element to the array. The retrieve data from the column can be: `first` entry, `last` entry or `all` entries (concatenated with ;)', 0),
(0000000007, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000007, 0000000026, NULL, 'Only use <a href=\"https://en.wikipedia.org/wiki/Markdown\" target=\"_blank\">markdown</a> elements that can be displayed inline (e.g. bold, italic, etc).', 0),
(0000000008, 0000000008, NULL, 'The text to appear on the button.', 0),
(0000000008, 0000000023, NULL, 'Allows to assign CSS classes to the root item of the style.', 0),
(0000000008, 0000000027, NULL, 'Use a full URL or any special characters as defined <a href=\"https://selfhelp.psy.unibe.ch/demo/style/440\" target=\"_blank\">here</a>.', 0),
(0000000008, 0000000028, 'primary', 'The <a href=\"https://getbootstrap.com/docs/4.1/components/buttons/#examples\" target=\"_blank\">bootstrap type</a> of the button.', 0),
