(0000000010, 0000000095, 'Lobby', 'The name of the root chat room (the room every user is part of).', 0),
(0000000010, 0000000096, 'New Messages', 'This text is used as a divider between messages that are already read and new messages.', 0),
(0000000010, 0000000110, NULL, 'The notification email to be sent to receiver of the chat message. Use markdown syntax in conjunction with the field `is_html` if you want to send an email with html content. In addition to markdown, the following keyword is supported:\n- `@link` will be replaced by the link to the chat page.', 0),
(0000000010, 0000000111, NULL, 'The subject of the notification email to be sent to the receiver of the chat message. Use the following keywords to create dynamic content:\n- `@project` will be replaced by the project name.', 0),
(0000000010, 0000000114, '0', 'If *checked*, the email will be parsed as markdown and sent as html. The unparsed email content will be sent as plaintext alternative. If left *unchecked* the emails will only be sent as plaintext', 0),
