(0000000027, 0000000071, NULL, 'This field expects a [JSON](!https://www.json.org/json-en.html) list of source objects where each object has the following keys:\n - `source`: The source of the video file. If it is an asset, simply use the full name of the asset.\n - `type`: The [type](!https://developer.mozilla.org/en-US/docs/Web/Media/Formats/Containers) of the video file.\n\nFor example:\n```\n[{\n  \"source\": \"video_name.mp4\",\n  \"type\": \"video/mp4\"\n}, {\n  \"source\":\"video_name.ogg\",\n  \"type\": \"video/ogg\"\n}, {\n  \"source\":\"video_name.webm\",\n  \"type\": \"video/webm\"\n}]\n```\n', 0),
