(0000000028, 0000000066, NULL, 'This field expects a [JSON](!https://www.json.org/json-en.html) list of objects where each object has the following keys:\n - `id`: A unique identifier of the item\n - `title`: The name of the item.\n - `url`: An URL to where this item will link. This field is optional.\n - `children`: A list of objects, again with the keys `id` and `title` and the optional keys `url` and `children`\n\nFor example:\n```\n[{\n  \"id\": 1,\n  \"title\": \"Item1\",\n  \"children\": [{\n    \"id\": 2,\n    \"title\": \"Item1.1\"\n  }, {\n    \"id\": 3,\n    \"title\": \"Item1.2\",\n    \"children\": [{\n      \"id\": 4,\n      \"title\": \"Item1.2.1\"\n    }]\n  }]\n},\n{\n  \"id\": 5,\n  \"title\": \"Item2\",\n  \"children\": [{\n     \"id\": 5,\n     \"title\": \"Item2.1\"\n  }] \n},\n{\n  \"id\": 6,\n  \"title\": \"Item3\",\n  \"children\": [{\n     \"id\": 7,\n     \"title\": \"Item3.1\"\n  }]\n}]\n```\n.', 0),
(0000000028, 0000000072, NULL, 'This field only has an effect if root items have an URL defined (see field `items`). If not defined, links on root items will be displayed as symbols. To expand the root item one would click on the root item and to follow to the link one would click on the link symbol. If this field is set instead of the link symbol, a new chlid element will be generated which serves as a link to the URL of the root item. The here defined text will be used as label for this link.', 0),
