(0000000034, 0000000066, NULL, 'This field expects a [JSON](!https://www.json.org/json-en.html) list of objects where each object has the following keys:\n - `id`: A unique identifier of the item\n - `title`: The name of the item.\n - `url`: An URL to where this item will link. This field is optional.\n - `css`: A custom css class to be added to this item. This is useful for ignoring or blocking items when dragging.\n\nFor example:\n```\n[{\n  \"id\": 1,\n  \"title\": \"Item 1\"\n},{\n  \"id\": 2,\n  \"title\": \"Item 2\",\n  \"url\": \"#\",\n  \"css\": \"custom\"\n},{\n  \"id\": 3,\n  \"title\": \"Item 3\"\n}]\n```\n.', 0),
