(0000000034, 0000000080, NULL, 'If set next to each item in the list a cross symbol will be rendered. Each symbol is a link with an URL as defined here. The string `:did` will be replaced with the id of the clicked item. For this field to have an effect, the field `is_editable` must be enabled.', 0),
