(0000000038, 0000000066, NULL, 'This field expects a [JSON](!https://www.json.org/json-en.html) list of radio objects where each object has the following keys:\n- `value`: the value to be submitted if this item is selected\n-`text`: the text rendered next to the radio button.\n\nAn Example\n```\n[{\n  \"value\":\"1\",\n  \"text\": \"Item1\"\n},\n{\n  \"value\":\"2\",\n  \"text\":\"Item2\"\n},\n{\n  \"value\":\"3\",\n  \"text\": \"Item3\"\n}]\n```', 0),
