(0000000044, 0000000071, NULL, 'This field expects a [JSON](!https://www.json.org/json-en.html) list of source objects where each object has the following keys:\n - `source`: The source of the image file. If it is an asset, simply use the full name of the asset.\n - `alt`: The alternative text to be displayed if the image connot be loaded.\n - `caption`: The image caption to be displayed at the bottom of the image.\n\nFor example:\n```[{\n  \"source\": \"slide1.svg\",\n  \"alt\": \"Image Description of Slide 1\",\n  \"caption\": \"Image Caption of Slide 1\"\n}, {\n  \"source\":\"slide2.svg\",\n  \"alt\": \"Image Description of Slide 2\",\n  \"caption\": \"Image Caption of Slide 2\"\n}, {\n  \"source\":\"slide3.svg\",\n  \"alt\": \"Image Description of Slide 3\",\n  \"caption\": \"Image Caption of Slide 3\"\n}]\n```\n', 0),
