(0000000048, 0000000108, NULL, 'A list of email addresses to be notified on submit with an email as defined in field `email_admins`. Use `json` syntax to specify the list of admins (e.g. `[\"__admin_1__\", ..., \"__admin_n__\"]`) where `__admin_*__` is the email address of an admin.', 0),
(0000000048, 0000000109, NULL, 'The email to be sent to the the list of admins defined in the field `admins`. Use markdown syntax in conjunction with the field `is_html` if you want to send an email with html content. In addition to markdown, the following keyword is supported:\n- `@email` will be replaced by the email address entered in the form.', 0),
(0000000048, 0000000110, NULL, 'The email to be sent to the the email address that was entered into the form. Use markdown syntax in conjunction with the field `is_html` if you want to send an email with html content.\n', 0),
(0000000048, 0000000111, NULL, 'The subject of the email to be sent to the the email address that was entered into the form. Use the following keywords to create dynamic content:\n- `@project` will be replaced by the project name.', 0),
(0000000048, 0000000112, NULL, 'The list of attachments to the email to be sent to the the address that was entered into the form. Use `json` syntax to specify a list of assets (e.g. `[\"__asset_1__\", ..., \"__asset_n__\"]`) where `__asset_*__` is the name of an uploaded asset.', 0),
(0000000048, 0000000113, '0', 'If checked, the entered email address will be stored in the database.', 0),
(0000000048, 0000000114, '0', 'If *checked*, the email will be parsed as markdown and sent as html. The unparsed email content will be sent as plaintext alternative. If left *unchecked* the emails will only be sent as plaintext', 0),
